(6, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo số liệu của&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Opta Joe</em>, tập thể Manchester United của Jose Mourinho đang trải qua chuỗi 13 trận bất bại liên tiếp, thành tích tốt nhất của đội bóng này tính từ khi Sir Alex chia tay sân Old Trafford.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trong mùa giải 2012/13, thầy trò Sir Alex Ferguson lập thành tích 18 trận bất bại liên tiếp. Muốn chạm đến cột mốc này, tập thể cầu thủ dưới quyền Mourinho sẽ phải cố gắng hơn nữa.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trước mắt vào ngày 14/1 tới, The Red Devils sẽ đối đầu với ngọn núi cao mang tên Liverpool trong trận derby nước Anh.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"MU dang bat bai lau nhat trong thoi hau Sir Alex hinh anh 1\" height=\"621\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/mdf_Nexqxk/2017_01_03/GettyImages630802804_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"1024\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Ibrahimovic ghi bàn ấn định tỷ số 2-0.&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Ảnh: Getty.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Thắng 2-0 trên sân West Ham đánh dấu lần thứ 7 liên tiếp MU ca khúc khải hoàn trên các đấu trường. Đây cũng là chuỗi thắng dài nhất của Mourinho kể từ năm 2014 khi còn làm thuyền trưởng Chelsea.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Giành 3 điểm trên sân khách, Quỷ đỏ Manchester vẫn đứng vị trí thứ sáu với 39 điểm. Đối thủ trực tiếp Tottenham sẽ thi đấu trận derby London với Chelsea vào lúc 3h sáng ngày 5/1 (giờ Việt Nam).</p>\r\n\r\n<div class=\"notebox ncenter\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 10px 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: rgb(217, 230, 240); text-size-adjust: 100%; color: rgb(0, 0, 0); line-height: 26px; float: left; width: 660px; font-family: &quot;Noto Serif&quot;, serif;\">\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Một số thống kê khác</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">18</strong>: Đó là số bàn thắng của Ibrahimovic ghi được trên mọi mặt trận mùa này, vượt trên thành tích của chân sút tốt nhất MU (Anthony Martial, 17 bàn) cả mùa trước.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">40</strong>: Mata đã tham gia vào 40 bàn thắng (25 kiến tạo, 15 pha lập công) từ khi ra mắt MU. Anh đứng thứ nhì trong đội hình Quỷ đỏ, sau Rooney.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">8</strong>: Không đội nào bị đuổi nhiều người hơn West Ham ở Premier League 2016/17.</p>\r\n</div>', '', '', 'null', 'null', 0, 127, 1, 1, 1, 0, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:34:39', '2017-07-26 14:52:57'),
(7, 'Sản xuất vật liệu xây dựng và cơ khí', 'san-xuat-vat-lieu-xay-dung-va-co-khi', '', 15, 'vietnamese', '[\"15\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Chào mừng quý khách hàng đến với website của Nhũ Tương Puma Kính thưa quý khách hàng Công ty cổ phần Nhũ Tương Puma Việt Nam với kinh nghiệm 10 năm trong lĩnh vực sản xuất vật liệu cho các công trình xây dựng.</p>', '', '<header class=\"the-article-header\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 660px; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">\r\n<h1 class=\"the-article-title cms-title\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 2rem; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: &quot;Noto Serif&quot;, serif; color: rgb(17, 17, 17); -webkit-font-smoothing: antialiased; letter-spacing: -1px !important;\">Điểm danh những \'bóng hồng\' xinh đẹp của Sơn Tùng M-TP</h1>\r\n\r\n<ul class=\"the-article-meta\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 5px 0px 0px; padding-right: 0px; padding-left: 3px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; list-style: none; float: left; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(153, 153, 153); line-height: 18px; -webkit-font-smoothing: antialiased;\">\r\n	<li class=\"the-article-publish cms-date\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 10px 10px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; display: block;\">09:53 06/01/2017</li>\r\n</ul>\r\n</header>\r\n\r\n<ul class=\"th