(8, 'Nhập khẩu và kinh doanh', 'nhap-khau-va-kinh-doanh', '', 15, 'vietnamese', '[\"15\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Chào mừng quý khách hàng đến với website của Nhũ Tương Puma Kính thưa quý khách hàng Công ty cổ phần Nhũ Tương Puma Việt Nam với kinh nghiệm 10 năm trong lĩnh vực sản xuất vật liệu cho các công trình xây dựng.</p>', '', '<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 20px 0px 30px -60px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 920px; float: none; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Ronaldo lan thu 11 gop mat o doi hinh tieu bieu UEFA hinh anh 1\" height=\"960\" src=\"http://znews-photo.d.za.zdn.vn/w1024/Uploaded/mdf_rexqdd/2017_01_06/0.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px -5px; padding: 0px; border: 0px; outlin