 border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Ronaldo lan thu 11 gop mat o doi hinh tieu bieu UEFA hinh anh 11\" height=\"529\" src=\"http://znews-photo.d.za.zdn.vn/w1024/Uploaded/mdf_rexqdd/2017_01_06/10.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px -5px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 920px; height: auto;\" title=\"Ronaldo lần thứ 11 góp mặt ở đội hình tiêu biểu UEFA hình ảnh 11\" width=\"940\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Tiền đạo Antoine Griezmann (Pháp - Atletico Madrid):</strong>&nbsp;Ngôi sao người Pháp đã lọt vào đến 2 trận chung kết trong năm 2016 (Champions League, Euro) nhưng đều phải nhận thất bại một cách cay đắng.&nbsp;</td>\r\n		</tr>\r\n	</tbody>\