(9, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '', '<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 20px 0px 30px -60px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 920px; float: none; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22p