px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\">2 ngày sau thắng lợi nhọc nhằn trước Middlesbrough, thầy trò Jose Mourinho hành quân đến sân Olympic với tâm thế khá rụt rè. Phát biểu trước trận, \"Người đặc biệt\" chỉ đặt mục tiêu giành điểm trước chủ nhà West Ham.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 20px 0px 30px -60px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 920px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent