sed;\">Bảng xếp hạng sau loạt trận tối và đêm thứ hai.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', '', 'null', 'null', 0, 127, 1, -1, 1, 0, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:43:24', '2017-07-26 14:52:08');
