(30, 'Giới thiệu công ty Nhũ Tương Puma', 'gioi-thieu-cong-ty-nhu-tuong-puma', '', 14, 'vietnamese', '[\"14\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Chào mừng quý khách hàng đến với website của Nhũ Tương Puma Kính thưa quý khách hàng Công ty cổ phần nhũ tương Puma Việt Namvới kinh nghiệm 10 năm trong lĩnh vực sản xuất vật liệu cho các công trình xây dựng. Chúng tôi là đơn vị chuyên sản xuất vật liệu cho các công trình xây dựng cơ sở hạ tầng như: đường bộ, cầu, các tòa nhà cao tầng,… Trải qua hàng chục năm kinh doanh, công ty liên tục phát triển và không ngừng lớn mạnh, trở thành một trong những nhà cung cấp vật liệu hàng đầu cho các công trình giao thông, các dự án xây dựng đô thị,… tại Việt Nam.</p>', '', '<div class=\"img_caption left\" style=\"float: left; width: 150px;text-align:center;margin-right: 15px;\"><img alt=\"\" src=\"http://intracolaw.com.vn/app/webroot/upload/image/images/mr%20dung.png\" style=\"width: 150px; height: 217px;\" /><br />\r\nLS. Đặng Hoàng Dũng</div>\r\n\r\n<p><b>Thưa Quý Khách hàng,</b></p>\r\n\r\n<p style=\"text-align: justify;\">Với dân số khoảng 92 triệu người và cơ cấu dân số trẻ và tỷ lệ tăng trưởng GDP cao, Việt Nam thực sự là một thị trường sôi động và đầy hứa hẹn cho hoạt động thương mại và đầu tư.</p>\r\n\r\n<p style=\"text-align: justify;\">Tuy nhiên, trong quá trình hội nhập kinh tế thế giới, do nhiều yếu tố về kinh tế, lịch sử và văn hoá mà hệ thống pháp luật Việt Nam luôn trong trạng thái vận động. &nbsp;Nhiều quy định được sửa đổi, nhiều quy định mới được ban hành, những nội dung này gây trở ngại cho việc tìm hiểu, áp dụng và thực thi pháp luật tại Việt Nam. Đây là thách thức không nhỏ cho doanh nghiệp trong và ngoài nước khi đầu tư, kinh doanh tại Việt Nam.</p>\r\n\r\n<p style=\"text-align: justify;\">Trước nhu cầu được trợ giúp pháp lý của nhiều tổ chức, cá nhân và doanh nghiệp, IntracoLaw đã được thành lập bởi một đội ngũ luật sư có nhiều năm kinh nghiệm trong lĩnh vực tư vấn pháp lý, tư vấn đầu tư, thương mại, sở hữu trí tuệ, giải quyết tranh chấp, đất đai, bất động sản, tài chính, ngân hàng.</p>\r\n\r\n<p style=\"text-align: justify;\">Tôn chỉ của Intraco Law là hỗ trợ doanh nghiệp có được sự hiểu biết về pháp lý đúng đắn và cập nhật nhất. Khách hàng của Intraco Law sẽ có được những tư vấn chuyên nghiệp để áp dụng một cách chuẩn mực các quy định của pháp luật vào các công việc kinh doanh. Bên cạnh đó các giải pháp pháp lý tối ưu là những gì Intraco Law sẽ đem lại khi khách hàng có nhu cầu.</p>\r\n\r\n<p style=\"text-align: justify;\">Chất lượng công việc và sự hài lòng của khách hàng luôn là mục tiêu hàng đầu mà Intraco Law hướng tới.</p>\r\n\r\n<p style=\"text-align: justify;\">Hy vọng sẽ có sự hợp tác tốt đẹp giữa IntracoLaw và Quý khách hàng</p>\r\n\r\n<p style=\"text-align: justify;\">Trân trọng,</p>\r\n\r\n<p style=\"text-align: justify;\"><b>Giám đốc</b></p>\r\n\r\n<p><b><a href=\"http://intracolaw.com.vn/\" title=\"luật sư\">Luật sư</a> . Đặng Hoàng Dũng</b></p>', '', '', 'null', 'null', 0, 127, 1, 1, 0, 0, 0, 0, 1, '', '', '', 1, 3, '2017-02-07 15:53:32', '2017-08-01 11:38:16'),
(31, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '', '<p style=\"text-align: justify;\"><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>\r\n\r\n<p>Dòng tivi Bravia của Sony từ lâu đã tạo được ấn tượng trong mắt người dùng nhờ sở hữu màn hình ấn tượng và nhiều trang bị thời thượng. Thời gian gần đây, Sony tiếp tục tăng cường những ảnh hưởng đó nhằm đem đến trải nghiệm hoàn hảo hơn cho khách hàng, và tạo lợi thế cạnh tranh trước các đối thủ sừng sỏ. Một trong số những nâng cấp này là việc hãng điện tử Nhật Bản trang bị cho tivi sony thêm nhiều loại kết nối hơn, giúp tivi Sony có thể truyền và nhận dữ liệu với nhiều thiết bị điện tử khác nhau, nhờ đó phát huy hết sức mạnh của dòng tivi Bravia danh tiếng.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>HDMI</strong></p>\r\n\r\n<p>HDMI là một chuẩn kết nối có khả năng truyền tải hình ảnh và âm thanh chất lượng cao từ thiết bị di động lên tivi qua một sợi cáp (Cách kết nối laptop với tivi qua cổng HDMI). Nếu như trước đây, để truyền tải nội dung bằng phương thức cũ, người ta phải dùng đến 3 sợi cáp khác nhau thì HDMI xuất hiện đã làm giảm bớt sự rườm rà này.</p>\r\n\r\n<p>HDMI có thể sử dụng với các thiết bị như điện thoại thông minh, máy tính bảng, laptop, và tivi… Cổng HDMI có mặt trên mọi loại tivi Sony đang được bán tại DienmayXANH.com, từ sản phẩm có giá rẻ nhất là Tivi LED Sony KDL-32R410B 32 inch có 2 cổng HDMI, đến dòng cao cấp nhất Internet Tivi 3D LED Sony KD-85X9500B 85 inch có tới 4 cổng HDMI.</p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" class=\"aligncenter\" src=\"https://cdn1.dmx.vn/Files/2014/10/30/577514/1-3-cong-hdmi-tren-tivi-sony.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>3 cổng HDMI trên tivi Sony (vùng khoanh hồng)</em></p>\r\n\r\n<p style=\"text-align: justify;\"><strong>USB</strong></p>\r\n\r\n<p>USB là gì? có thể hiểu đơn giản USB một chuẩn kết nối dùng để truyền và nhận dữ liệu. Kết nối USB xuất hiện lần đầu trên máy tính cá nhân, nhưng sau nay khi tivi được trang bị khả năng giao tiếp thông minh có thể nhận và đọc được các file giải trí nhiều định dạng thì kết nối USB đã được tích hợp thẳng trên tivi giúp người dùng sử dụng đơn giản hơn mà không phải dùng cáp để chuyển từ máy tính sang (Cách xem dữ liệu từ USB trên tivi).</p>\r\n\r\n<p>Trên tivi Sony, kết nối USB cũng có số lượng khác nhau chứ không đồng nhất, thông thường là từ 2 đến 3 cổng.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" class=\"aligncenter\" src=\"https://cdn2.dmx.vn/Files/2014/10/30/577514/2-ket-noi-usb-tren-tivi.jpg\" /><br />\r\n<strong>MHL</strong></p>\r\n\r\n<p>MHL là một chuẩn kết nối thế hệ mới cũng có tác dụng truyền tải hình ảnh, âm thanh từ thiết bị di động ra một màn hình ngoài tương tự HDMI. Ưu điểm của giao tiếp này là khi kết nối với tivi, thiết bị di động của bạn sẽ được sạc cùng lúc, hạn chế được tình trạng hết pin đột ngột so với việc dùng HDMI.</p>\r\n\r\n<p>hiện nay MHL được tích hợp thẳng vào cáp HDMI với 1 đầu là cổng Micro USB và đầu còn lại là cổng HDMI để kết nối vào tivi. Thao tác kết nối cũng khá đơn giản, chỉ qua 4 bước cơ bản, chúng ta có thể kết nối điện thoại với tivi thông qua MHL. Về sự hỗ trợ của MHL đối với tivi và thiết bị di động, có thể xác định như sau: Hầu hết các internet tivi của Sony đều hỗ trợ MHL, ví dụ như: Internet Tivi LED Sony KDL-32W700B 32 inch, đây là chiếc internet tivi có giá tốt nhất tại DienmayXANH.com, sản phẩm hỗ trợ MHL và khá nhiều kết nối cao cấp khác. Còn đối với smartphone hỗ trợ MHL, bạn có thể xem tại đây.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn3.dmx.vn/Files/2014/10/30/577514/3-mhl-tren-tivi-sony.jpg\" /><br />\r\n<em>Screen Mirroring</em></p>\r\n\r\n<p style=\"text-align: center;\">Screen Mirroring là kết nối thông minh thường gặp trên các dòng internet tivi của Sony, Screen Mirroring cho phép tivi Sony hiển thị hình ảnh trực tiếp từ thiết bị di động tương thích với cách ghép nối rất đơn giản không cần dây, giúp người dùng trải nghiệm hình ảnh đã hơn thông qua những màn hình 32 inch, 48 inch hay thậm chí 85 inch.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn4.dmx.vn/Files/2014/10/30/577514/ava.jpg\" /><br />\r\n<em>Photo share</em></p>\r\n\r\n<p style=\"text-align: justify;\">Photo Share là tiện ích độc quyền của các dòng tivi Sony Bravia. Tiện ích này cho phép người dùng có thể dễ dàngchia sẻ dữ liệu hình ảnh từ smartphone Xperia sang tivi Sony mà không cần sử dụng đến mạng internet hay bất kỳ một loại cáp kết nối nào. Photo share hiện mới có mặt trên các dòng internet tivi của Sony.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn1.dmx.vn/Files/2014/10/30/577514/4-photoshare-tren-tivi-sony.jpg\" /></p>\r\n\r\n<p>Ngoài công nghệ hình ảnh, công nghệ âm thanh đặc trưng, tính năng bộ tứ bảo vệ độc quyền, tivi Sony còn chinh phục người dùng bởi các tính năng kết nối tiện ích hấp dẫn.</p>\r\n\r\n<p><strong>Tags</strong>:&nbsp;<a data-blogger-escaped-target=\"_blank\" href=\"http://trungtambaohanhtivisony.com.vn/gioi-thieu/\" title=\"trung tâm bảo hành Tivi Sony tại Hà nội\">trung tâm bảo hành Tivi Sony tại Hà nội</a>&nbsp;,&nbsp;<a data-blogger-escaped-target=\"_blank\" href=\"http://trungtambaohanhtivisony.com.vn/gioi-thieu/\" title=\"trung tâm bảo hành Tivi Sony tại hải phòng\">trung tâm bảo hành Tivi Sony tại hải phòng</a></p>', '', '', 'null', 'null', 0, 0, 1, -1, 0, 0, 0, 0, 1, '', '', '', 1, 1, '2017-02-09 15:28:34', '2017-07-26 14:51:41'),
(32, 'Bạch tật lê', 'bach-tat-le', '', 35, 'vietnamese', '[\"35\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Dâm dương hoắc</strong>: Dâm Dương Hoắc là tên 1 loại cây dại, từ lâu đã được dùng làm thuốc trong YHCT. Khoa học hiện đạiđã có nhiều nghiên cứu về công dụng của Dâm Dương Hoắc trong điều trị yếu sinh lý.</p>', '', '<p style=\"text-align: justify;\"><strong>X-Reality™ PRO</strong></p>\r\n\r\n<p>X-Reality PRO là công nghệ xử lý hình ảnh cho phép nâng cao chất lượng hiển thị của hình ảnh và video giúp chúng trông sắc nét hơn, giảm nhiễu, cải thiện độ tương phản các sắc đậm nhạt trong mỗi khung hình.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn1.dmx.vn/Files/2014/10/23/575662/tivi-sony-va-cac-cong-nghe-hinh-anh-doc-dao-0-1.png\" /></p>\r\n\r\n<p style=\"text-align: center;\"><em>Hình ảnh chân thật, chính xác</em></p>\r\n\r\n<p style=\"text-align: justify;\">4K X-Reality PRO là công nghệ cải tiến từ X-Reality Pro dùng cho dòng tivi Sony với màn hình 4K. Công nghệ này giúp nâng cấp các hình ảnh độ phân giải thấp để trình chiếu lên Tivi 4K hoàn hảo gần như đạt độ phân giải 4K. Công nghệ hình ảnh 4K X-Reality Pro giúp khắc phục sự hạn chế của nguồn video chuẩn 4K trên thị trường hiện đang thiếu hụt.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn2.dmx.vn/Files/2014/10/23/575662/tivi-sony-va-cac-cong-nghe-hinh-anh-doc-dao-1.png\" /></p>\r\n\r\n<p style=\"text-align: center;\">Màu sắc sống động, rực rỡ</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>X-tended Dynamic Range PRO</strong></p>\r\n\r\n<p>Công nghệ chiếu sáng X-tended Dynamic Range PRO sử dụng một hiệu ứng đặc biệt với đèn nền, cho phép mở rộng độ sáng lên gấp 3 lần (so với tivi thông thường) nhằm mang lại chiều sâu cho ảnh, mang đến cho người xem trải nghiệm chân thực, sống động.</p>\r\n\r\n<p>Chúng ta cũng không nên nhầm lẫn giữa độ sáng và độ chói của hình ảnh, đây là hai khái niệm hoàn toàn khác nhau. Khi nói đến mức độ sáng, điều đó có nghĩa là bạn đang đề cập đến một chỉ số toàn diện hơn về việc thể hiện độ sâu của màu đen và khả năng tái tạo của cường độ sáng.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn3.dmx.vn/Files/2014/10/23/575662/tivi-sony-va-cac-cong-nghe-hinh-anh-doc-dao-2-1.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\">Khả năng hiển thị chính xác với thực tế</p>\r\n\r\n<p style=\"text-align: justify;\">Chính vì vậy, khi thử xem một bộ phim trên tivi Sony Bravia, người xem sẽ cảm nhận được độ sâu hình ảnh một cách rõ nét và tạo cho bạn cảm giác như đang nhìn vào một cảnh thực bên ngoài.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>TRILUMINOS™ Display</strong></p>\r\n\r\n<p>TRILUMINOS Display cho phép ra tái tạo những mảng màu rộng hơn hẳn các công nghệ cũ trước, giúp các màu sắc khó tái tạo nhất trở nên chân thật, tự nhiên, đặc biệt là màu đỏ, xanh lục hay xanh lam được thể hiện rực rỡ và bắt mắt hơn.</p>\r\n\r\n<p><img alt=\"\" class=\"aligncenter\" src=\"https://cdn4.dmx.vn/Files/2014/10/23/575662/tivi-sony-va-cac-cong-nghe-hinh-anh-doc-dao-3-1.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\">Màu sắc rực rỡ, sống động</p>\r\n\r\n<p style=\"text-align: justify;\">Để dễ dàng nhận biết về khả năng tái tạo của công nghệ này, bạn có thể đặt hai màn ảnh tivi có công nghệ TRILUMINOS Display và không như hình trên. Màu sắc của màn hình trên tivi LED thông thường cho màu có phần hơi tối, nhợt nhạt; trong khi công nghệ TRILUMINOS Display lại cho ra màu sống động và rực rỡ hơn nhiều lần.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Clear Resolution Enhancer</strong></p>\r\n\r\n<p>Công nghệ giảm nhiễu Clear Resolution Enhancer giúp nâng cao chất lượng hình ảnh trên tivi, với khả năng hoàn thiện lại kết cấu vỡ, giảm thiểu tối đa tình trạng mờ, nhòe, hình ảnh nhiễu ở khung hình cũ và phát ra các hình ảnh mới với độ sắc nét và chi tiết cao.</p>', '', '', 'null', 'null', 0, 127, 1, -1, 0, 0, 0, 0, 1, '', '', '', 1, 1, '2017-02-09 16:07:28', '2017-07-26 10:30:53');
