(42, 'Về chúng tôi', 've-chung-toi', '', 14, 'vietnamese', '[\"14\"]', '', '', '\"\"', '<p><strong>Sức khỏe của mẹ và bé yêu vô cùng quan trọng trong suốt quá trình mang thai, sinh nở.</strong></p>\r\n\r\n<p>Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết…</p>\r\n\r\n<p>Thấu hiểu được nỗi lo đó, Bệnh viện Đa khoa Tâm Anh đã xây dựng dịch vụ thai sản và sinh con trọn gói với các chế độ chăm sóc toàn diện, đạt chất lượng cao theo tiêu chuẩn Quốc tế</p>', '', '<p>Nullam dolor sapien, egestas pharetra quam sed, blandit efficitur nunc. Nunc vel lacus quam. Sed bibendum dui et nibh pellentesque, eget dignissim arcu mollis. Pellentesque gravida eu lorem non ornare. Pellentesque et finibus lorem.</p>\r\n\r\n<p>In congue ante ut facilisis ultrices. Suspendisse mauris leo, sodales in augue quis, convallis scelerisque velit. Sed justo lectus, maximus eget finibus nec, congue et neque. Proin nec nisl non nisi iaculis bibendum. Maecenas commodo arcu sit amet faucibus sagittis. Proin pretium felis eget nisl vestibulum, in malesuada eros viverra. Integer ut sem facilisis, bibendum lacus ac, venenatis lectus. Quisque auctor magna non ligula aliquam dictum. Integer accumsan, felis interdum dignissim egestas, quam leo porta ex, elementum commodo quam mi sit amet urna. Pellentesque fermentum ullamcorper ornare.</p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 20px; color: rgb(153, 51, 0);\">TỔNG QUAN DỰ ÁN</span></h3>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tên dự án:</span>&nbsp;Khu đô thị Gamuda Gardens.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Vị trí vàng:</span>&nbsp;Km 4,4 Pháp Vân, Quận Hoàng Mai, Hà Nội.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Chủ đầu tư:</span>&nbsp;Công ty Gamuda Land Việt Nam( 100% Vốn Malaysia).</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Tổng vốn đầu tư lên tới&nbsp;5 tỉ USD</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tổng diện tích đất:</span>&nbsp;73ha –&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Mật độ cây xanh:</span>&nbsp;50%</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Sản phẩm:</span>&nbsp;<span style=\"color:#FF0000;\"><span style=\"font-size:16px;\"><strong>Biệt thự đơn lập, biệt thự song lập, nhà liền kề, Nhà phố Shophouse Và chung cư cao cấp.</strong></span></span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tiện ích:</span>&nbsp;Trường học quốc tế, bệnh viên, nhà trẻ, bể bơi, sân thể thao, phòng tập Gym,&nbsp;trung tâm thương mại…đã xây dựng xong và đi vào sử dụng cho cư dân</li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><img alt=\"\" src=\"/uploads/images/gamuda-city.jpg\" style=\"width: 1337px; height: 503px;\" /><br />\r\n&nbsp;</p>\r\n\r\n<h3 class=\"h2\" style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 20px;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 0);\">VỊ TRÍ VÀNG</span></span></span></h3>\r\n\r\n<div class=\"h2\" style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 26px; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: 700;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"box-sizing: border-box; font-size: 14px;\">CỬA NGÕ PHÍA NAM HÀ NỘI</span></span></div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><strong><span style=\"font-size:16px;\"><span style=\"color:#FF0000;\">Khu đô thị&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda City</span>&nbsp;tọa lạc tại vị trí chiến lược ngay cửa ngõ phía Nam Hà Nội, chỉ cách Hồ Hoàn Kiếm 6km và Khu Phố cổ 25 phút đi xe.</span></span></strong></p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><strong><span style=\"font-size:16px;\"><span style=\"color:#FF0000;\">Tuyến đường Giải Phóng &amp; Tam Trinh: kết nối với trung tâm Hà Nội trong khoảng cách 7km.</span></span></strong></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><strong><span style=\"font-size:16px;\"><span style=\"color:#FF0000;\">Tuyến đường vành đai 3: kết nối với khu vực Trung tâm Hội nghị Quốc gia trong vòng 15 phút đi xe.</span></span></strong></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><strong><span style=\"font-size:16px;\"><span style=\"color:#FF0000;\">Tuyến tàu điện ngầm số 3: kết nối khu vực Nhổn (phía Tây) với Tam Trinh (phía Nam)</span></span></strong></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><strong><span style=\"font-size:16px;\"><span style=\"color:#FF0000;\">Gamuda City cũng có thể dễ dàng kết nối với Quốc lộ 1A và 1B để vào Hà Nội, cũng như từ phía Nam Hà Nội hướng đi Miền Trung Việt Nam, Thành Phố Hồ Chí Minh, đường Vành Đai 3 mới xây dựng, cầu Thanh Trì và đường Vành Đai 4 trong tương lai.</span></span></strong></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><img alt=\"\" class=\"aligncenter wp-image-1663\" height=\"438\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/v%E1%BB%8B-tr%C3%AD-gamuda-city2.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/vị-trí-gamuda-city2.jpg 950w, http://gamudacity.info/wp-content/uploads/2016/06/vị-trí-gamuda-city2-300x164.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></span></span></p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: justify;\">&nbsp;</h2>\r\n\r\n<h1 style=\"box-sizing: border-box; margin: 10px 0px; font-size: 2.6rem; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1538; text-align: center;\"><span style=\"box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 0);\">TIỆN ÍCH&nbsp;GAMUDA GARDENS</span></span></span></h1>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;có mọi tiện ích cho cuộc sống hoàn hảo. Không cần phải đi đâu xa, cư dân hoàn toàn có thể tận hưởng những tiện nghi đẳng cấp như:</p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: none; list-style-position: inside; padding-bottom: 10px;\">\r\n	<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px;\">\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Nhà phố thương mại sầm suất.</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Công viên Yên Sở</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Clubhouse Với nhà hàng, bể bơi, phòng tập Gym chuẩn 5 Sao.</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Phòng tập gym, sân tennis, nhà hàng.</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Trường học liên cấp quốc tế Singapore.</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Sức khỏe &amp; y tế: bệnh viện đa khoa quốc tế</li>\r\n		<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Hệ thống an ninh nghiêm ngặt với các cổng bảo vệ, nhóm tuần tra an ninh, hệ thống CCTV 24/24.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><img alt=\"\" class=\"aligncenter wp-image-1664 size-full\" height=\"377\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-gamuda-gardens-1-800x377.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-gamuda-gardens-1-800x377.jpg 800w, http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-gamuda-gardens-1-800x377-300x141.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: center;\">&nbsp;</h2>\r\n\r\n<h1 style=\"box-sizing: border-box; margin: 10px 0px; font-size: 2.6rem; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1538; text-align: center;\"><span style=\"box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 0);\">BAO GỒM 5 SẢN PHẨM&nbsp;CHÍNH</span></span></span></h1>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;là một trong bốn khu phức hợp chính của&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda City</span>, được xây dựng với mục tiêu trở thành khu dân cư có đầy đủ mọi trang thiết bị hiện đại và tiện ích cộng đồng, bao gồm câu lạc bộ giải trí, trường công và trường quốc tế, trung tâm thương mại với không gian văn phòng và kinh doanh, các cửa hàng lân cận và nhà trẻ.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><img alt=\"\" class=\"aligncenter wp-image-1666\" height=\"408\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-lien-ke-the-green-daisy-the-green-1.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-lien-ke-the-green-daisy-the-green-1.jpg 980w, http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-lien-ke-the-green-daisy-the-green-1-300x153.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">Với tổng quan quy hoạch&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;gồm 4 hạng mục sản phẩm chính là : Liền kề , Nhà phố thương mại, Biệt thự và Chung cư .. sẽ mang đến 1 khu đô thị sầm uất, đông vui cùng với nhiều dịch vụ tiện ích chuẩn 5sao.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><img alt=\"\" class=\"aligncenter wp-image-1668\" height=\"266\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-khu-do-thi-gamuda-gardens.png 1024w, http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-khu-do-thi-gamuda-gardens-300x100.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: center;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 0); font-family: &quot;times new roman&quot;, times, serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">1. BIỆT THỰ SONG LẬP</span></span></h2>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Thiết kế&nbsp;biệt thự song lập Gamuda – Iris Homes</span></h3>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">Dãy nhà&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Song Lập Iris&nbsp;Homes</span>&nbsp;là ngôi nhà vườn trong phố với không gian xanh, thanh bình của vườn cây, tiểu cảnh nước hòa mình cùng sắc xanh trong lành của công viên, đường dạo và tiện ích cộng đồng hiện đại khác thuộc tiểu khu Eden của Khu đô thị Gamuda Gardens.</p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Diện tích đất : Từ 147 – 303,3m2.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Diện tích xây dựng 3,5 tầng: 265m2 – 292&nbsp;m2</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Kích thước: Mặt tiền từ 7 – 11 m. Chiều sâu nhà : 21 – 22,5 m</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Phòng ngủ: 4&nbsp;phòng + 1 phòng giúp việc + 1 phòng thờ trên tầng cao nhất.&nbsp;Phòng vệ sinh: 06 phòng.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Thời hạn sử dụng đất: Sổ đỏ&nbsp;vĩnh viễn</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">2 hướng chinh: Đông Nam(với khách hàng hợp Đông Tứ Mệnh) và Tây Bắc(với khách hợp Tây Tứ Mệnh) nên sẽ đáp ứng được nhu cầu của tất cả các khách hàng</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Giá bán: Từ 57 – 75 triệu/m2( Tùy từng vị trí và diện tích) chưa trừ chiết khấu.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Mua Biệt Thự Có Cơ Hội Nhận Xe&nbsp;Mercedes ( Chiết Khấu 8% )</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Tình trạng: Dự kiến bàn giao Quý I/2019</li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><a href=\"http://kdtgamudacity.com/biet-thu-song-lap-aris-home\">Xem Thêm</a></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><img alt=\"\" src=\"/uploads/images/tieu-khu-botanic-voi-quy-hoach-tong-the-thong-minh.png\" style=\"width: 1024px; height: 682px;\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif; color: rgb(153, 51, 0);\">2. BIỆT THỰ ĐƠN&nbsp;LẬP</span></span></h2>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">Đúng như tên gọi “<span style=\"box-sizing: border-box; font-weight: 700;\">Mansions</span>”, mỗi căn biệt thự có một không gian mở với sân phía trước, vườn nằm phía sau, tiểu cảnh bên hiên nhà, ôm trọn cuộc sống của gia chủ trong sự thoải mái và giao hòa cùng thiên nhiên. Tầng một với phòng khách, phòng ăn, bếp khô và bếp ướt cùng phòng ngủ cho người già. trong khi các tầng trên là các phòng ngủ riêng khéo léo kết hợp với các không gian chung như phòng khách nhỏ, phòng sinh hoạt chuoung, góc làm việc và đọc sách, góc thư giãn ngoài ban công.</p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Diện tích đất : 288m2-500m2.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Diện tích xây dựng 3 tầng: 408m2 – 418 m2</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Kích thước: Mặt tiền từ 12-18m. Chiều sâu nhà : 24m</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Phòng ngủ: 5 phòng + 1 phòng ngủ cho giúp việc.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Phòng tắm: 06 phòng.&nbsp;Tầng hầm : 01 hầm</li>\r\n