s&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">&nbsp;</p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: center;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif;\">4.&nbsp;NHÀ PHỐ THƯƠNG MẠI – SHOP HOUSE</span></span></span></h2>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tổng quan về Shop house Gamuda Garden</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify;\">Shophouse hay Nhà phố thương mại là mô hình kinh doanh được ưa chuộng ở các đô thị Châu Âu và Mỹ từ cách đây rất lâu, sau đó xuất hiện ở Châu Á và ngày càng được “trọng vọng” tại các thành phố lớn của Đông Nam Á.</p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Khởi công : Quý I/2014. &nbsp;Bàn giao : Quý I/2015.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Tổng số căn : 15 căn.&nbsp;Diện tích đất: Từ 128 – 192 – 270 m2</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Diện tích xây dựng 4 tầng: Từ 380 – 517m2.&nbsp;Mật độ xây dựng : 65%.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Bố trí tầng : Tầng 1 và tầng 2 để kinh doanh, tầng 3 và tầng 4 để ở.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Phòng vệ sinh: 06 phòng.&nbsp;Kích thước tiêu chuẩn : 5.5 X 23.5 M.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Giá bán: Từ 90 triệu/m2.&nbsp;Hình thức sử hữu: Sổ đỏ vĩnh viễn.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao cơ bản.</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\">Chính Sách Bán Hàng Chiết Khấu 11%</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><a href=\"http://kdtgamudacity.com/nha-pho-gamuda\">Xem Thêm&nbsp;</a></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><img alt=\"\" class=\"aligncenter wp-image-1674\" height=\"408\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/nha-pho-shop-house-gamuda-gardens.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/nha-pho-shop-house-gamuda-gardens.jpg 980w, http://gamudacity.info/wp-content/uploads/2016/06/nha-pho-shop-house-gamuda-gardens-300x153.jpg 300w\" style=\"box-sizing: bord