ều được bao bọc bởi sân trước, vườn sau tạo thành một tổng thể kiến trúc hài hòa, thống nhất trong không gian xanh của khu đô thị. Mỗi căn liền kề Gamuda ST4 đều được thiết kế 1 phòng khách, 4 phòng ngủ, 1 phòng thờ ngoài ra còn có các khu sinh hoạt chung ở tầng 2 và tầng 3. Mặt khác, các căn liền kề ST4 còn có hệ thống cửa sổ lớn và ban công rộng giúp đón được lượng gió và ánh sáng tự nhiên chan hòa đến khắp phòng.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2063\" height=\"526\" sizes=\"(max-width: 826px) 100vw, 826px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17.png 826w, http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17-300x191.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"826\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><em style=\"box-sizing: border-box;\">Không gian xanh quang khu nhà</em>&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14p