ify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mặt Bằng Tầng &nbsp;– Căn Tiêu Chuẩn</span></span></p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích đất</span>&nbsp;: Từ 105m2 – 428m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích xây dựng 3 tầng</span>&nbsp;: Từ 197m2 – 205m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng ngủ</span>: Gồm 4 phòng ngủ chính và 1 phòng giúp việc</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng vệ sinh</span>: 5 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng thờ</span>: 1 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hình thức sở hữu</span>: Sổ đỏ vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá bán</span>: Từ 45 – 60 triệu/m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá hấp dẫn chỉ từ 6,8 tỷ đến 8.5 tỷ</span></span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mức độ hoàn thiện:</span>&nbsp;Hoàn thiện mặt ngoài và bàn giao thô bên trong</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tình trạng:</span>&nbsp;Đang xây dựng, bàn giao vào Quý 4/2018</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px