tify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2097\" height=\"27\" sizes=\"(max-width: 434px) 100vw, 434px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png 434w, http://gamudacity.info/wp-content/uploads/2017/06/1.2-1-300x19.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"434\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Nhà liền kề giai đoạn 3 cũng được thừa hưởng toàn bộ tiện ích của khu đo thị Gamuda Gardens mang lại: Trường liên cấp quốc tế SIS , trường học công lập Lương Thế Vinh, bệnh viện quốc tế, 3 khu trung tâm thương mại, khu công viên, đường dạo bộ, câu lạc bộ Gamuda Gardens (bể bơi, phòng tập gym, spa, sân tennis…).</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2067\" height=\"341\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-khu-do-thi-gamuda-gardens.png 1024w, http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-khu-do-thi-gamuda-gardens-300x100.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"1024\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Dự án cũng có trạm cung ứng nhiên liệu và trung tâm thương mại dịch vụ Sông Hồng, Trung tâm chăm sóc sức khỏe Ba Son, Trường mẫu giáo Little Maple và Blossoms..</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2112\" height=\"750\" sizes=\"(max-width: 1000px) 100vw, 1000px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-gamuda-5.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-gamuda-5.png 1000w, http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-gamuda-5-300x225.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"1000\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Ngoài những tiện nghi mỗi căn Camelia Homes mang lại cho gia chủ, Gamuda Land Việt Nam còn miễn phí gói (Gamuda Smartlife”, bao gồm hệ thống nhà thông minh và các gói bảo hiểm có giá trị , thiết kế và tích hợp riêng biệt cho từng căn nhà.</span><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">– Hệ thống nhà thông minh SmartHomes từ BKAV trị giá 70 triệu đồng;</span><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">– 02 gói bảo hiểm đến từ Công ty Bảo Hiểm liberty (Hoa Kỳ) bao gồm bảo hiểm nhà ở là toàn bộ giá trị xây dựng của căn nhafvaf bảo hiểm tai nạn với mức bồi thường lên tới 9 tỷ đồng;</span><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">– Miễn phí 01 năm sử dụng Internet và truyền hình cáp.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"color: rgb(128, 0, 128); font-family: tahoma, arial, helvetica, sans-serif; font-size: 24px; font-weight: bold; text-align: center; background-color: rgb(255, 255, 200);\">Hotline : 0936130538</span></p>', '', '', 'null', 'null', 0, 0, 1, -1, 0, 0, 0, 0, 1, '', '', '', 1, 1, '2017-08-06 21:37:32', '2017-08-09 15:06:59');
