; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Giá</strong>&nbsp;: 7 tỷ – 9,5 tỷ</li>\r\n</ul>', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 32px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tổng quan nhà liền kề ST4 – Camelia Homes</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với những ưu điểm về vị trí dự án cũng như thiết kế cảnh quan,&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;trong giai đoạn 1 và giai đoạn 2 đã tạo dấu ấn trên thị trường bất động sản phía Nam Hà Nội. Trong giai đoạn 3, Gamuda Land Việt Nam tiếp tục cho ra mắt 133 căn biệt thự liền kề với tên gọi thương mại Camelia Homes ST4 có diện tích nhỏ hơn.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><img alt=\"\" class=\"aligncenter  wp-image-1867\" height=\"522\" sizes=\"(max-width: 747px) 100vw, 747px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png 1950w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-300x210.png 300w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-1024x715.png 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"747\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Vị trí Nhà liền kề ST4 trong khu đô thị Gamuda</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Nằm trong khuôn viên Gamuda Gardens – Khu đô thị tốt nhất Hà Nội, Camelia Homes là chốn an cư lý tưởng cho những gia đình tìm kiếm không gian sống xanh mát, rời xa những ồn ào của chốn đô thị trung tâm. Những dãy nhà liền kề thiết kế hiện đại, rộng thoáng, bao bọc bởi sân trước và vườn sau, tạo thành một thể kiến trúc thống nhất và năng động. Sở hữu điểm nhấn là những đóa hoa trà duyên dáng, hài hòa và cân đối, Camelia Homes mang đến nét độc đáo, chấm phá trong quang cảnh xanh mướt tại Khu đô thị Gamuda Gardens. Mô hình kiến trúc 3 tầng trên diện tích đất từ 105m2 – 271 m2, diện tích xây dựng từ 196m2 – 204m2, cho phép gia chủ tạo dựng một không gian phù hợp cho mọi sinh hoạt gia đình và mục đích sử dụng.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter  wp-image-1869\" height=\"555\" sizes=\"(max-width: 741px) 100vw, 741px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda-300x225.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"741\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Mô hình nhà liền kề ST4</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với sân trước, vườn sau bao quanh ngôi nhà, mỗi căn liền kề ST4 đều có 3 mặt thoáng cùng hệ thống cửa sổ kính lớn giúp không gian sống của gia chủ được rộng mở, đón trọn những nguồn ánh sáng và luồng gió tự nhiên vào từng góc phòng. Mỗi tầng đều có những khoảng không gian chung của gia đình như phòng khách, phòng đọc sách hay phòng học, phòng thờ …trong khi vẫn đảm bảo những không gian riêng rộng mở như phòng ngủ lớn và nhỏ được thiết kế hài hòa.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1874\" height=\"460\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/U297gRk-300x212.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; clear: both;\" width=\"650\" />Phối cảnh thiết kế liền kề ST4</p>\r\n\r\n<div class=\"wp-caption alignnone\" id=\"attachment_3974\" style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phong Cách Sống Lành Mạnh</span></span></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Liền kề ST4 Gamuda là một ngôi vườn trong phố với không gian xanh, thanh bình của vườn cây, tiểu cảnh nước hòa mình vào những sắc xanh trong lành của công viên, đường dạo và những tiện ích cộng đồng hiện đại khác thuộc Khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1868\" height=\"449\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao-300x207.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"650\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Một góc công viên nhỏ nhà liền kề ST4 Gamuda Gardens</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mặt Bằng Tổng Thể Liền Kề ST4 Gamuda</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Khu đô thị&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;là một trong bốn khu phức hợp chính của Gamuda City, được xây dựng với mục tiêu trở thành khu dân cư có đầy đủ mọi trang thiết bị hiện đại và tiện ích cộng đồng, bao gồm câu lạc bộ giải trí, trường công và trường quốc tế, trung tâm thương mại với không gian văn phòng và kinh doanh, các cửa hàng lân cận và nhà trẻ.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mặt Bằng Tầng &nbsp;– Căn Tiêu Chuẩn</span></span></p>\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding: 15px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích đất</span>&nbsp;:từ 105m2 – 428m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích xây dựng</span>&nbsp;:197m2 – 205m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng ngủ</span>: 4 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng vệ sinh</span>: 5 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng thờ</span>: 1 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Sở hữu</span>: Sổ đỏ vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá bán</span>: từ 45 – 60 triệu/m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá hấp dẫn chỉ từ 6,8 tỷ đến 8.5 tỷ</span></span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hoàn thiện:</span>&nbsp;Mặt ngoài và bàn giao thô</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Bàn giao:</span>&nbsp;Quý 4/2018</span></li>\r\n</ul>\r\n\r\n<div class=\"wp-caption alignleft\" id=\"attachment_4013\" style=\"box-sizing: border-box; display: inline; float: left; margin: 0.4em 1.6em 1.2em 0px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify; width: 832px;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><img alt=\"\" class=\"aligncenter  wp-image-1871\" height=\"493\" sizes=\"(max-width: 832px) 100vw, 832px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/M%E1%BA%B7t-b%E1%BA%B1ng-ST4-tung-t%E1%BA%A7ng.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng.jpg 1165w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-300x178.jpg 300w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-1024x606.jpg 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"832\" /></p>\r\n\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mặt bằng các căn tiêu chuẩn</p>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">** Giá và tiến Độ Thanh Toán :</span></span></div>\r\n\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">&nbsp;</div>\r\n\r\n<div data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">Giá hấp dẫn chỉ từ 6,8 tỷ/ căn tiêu chuẩn</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">Thanh toán trả chậm lên đến 3 năm không lãi suất cho chủ đầu tư Gamuda Land Việt Nam hỗ trợ.</div>\r\n\r\n<div data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">&nbsp;</div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"6negc-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"6negc-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">** Chính sách ưu đãi :</span></span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\">+ Tặng 1 Chuyến du lịch cho gia đình 4 người đến Nhật Bản – Hàn Quốc trị giá 200 triệu đồng ( bao gồm VAT) được quy đổi thành chiết khấu trừ vào đợt bàn giao nhà</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\">+ Tặng gói nội thất 80 Triệu trừ vào đợt thanh toán lần 1.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\">+ Dành cho KH thân thiết: Tặng 1 suzuki swift trị giá 550 triệu vnd đã bao gồm vat. Quy đổi thành chiết khấu và trừ vào đợt bàn giao nhà.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\">+ Tặng gói nội thất nhà thông minh Smart Home trị giá 70 Triệu. Tặng 1 năm Gói truyền hình cáp internet Và gói bảo hiểm nhà ở.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\">+ Miễn phí 3 năm phí quản lý và 3 năm phí sử dụng câu lạc bộ.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\">+ Giảm 20% học phí Trường Liên cấp quốc tế Việt Nam – Singapore.</span></div>\r\n\r\n<div data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Khu Đô Thị Tốt Nhất Hà Nội</span></span></div>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Vinh dự nhận giải thưởng Bất động sản Việt Nam cho hạng mục “Khu đô thị tốt nhất Hà Nội” 2105, Gamuda Gardens được đánh giá là một Khu đô thị có quy hoạch tổng thể thông minh, giàu tính nhân văn, thiết kế chất lượng, phát triển bền vững và những giá trị cốt lõi độc đáo.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1855\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens.jpg 800w, http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens-300x188.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Tại Gamuda Gardens, tiện nghi đã được hình thành với hệ thống hạ tầng đầy đủ và tiện ích đồng bộ như: Câu lạc bộ Gamuda Gardens với bể bơi, phòng tập gym, phòng xông hơi, sân tennis, phòng hội thảo và nhà hàng đều đã đi vào hoạt động. Trường liên cấp quốc tế Singapore (SIS) với hơn 2.000 học sinh từ tiểu học tới cấp 3.</span><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-size: 16px;\">Dự án cũng có trạm cung ứng nhiên liệu và trung tâm thương mại dịch vụ Sông Hồng, Trung tâm chăm sóc sức khỏe Ba Son, Trường mẫu giáo Little Maple và Blossoms..</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1876\" height=\"670\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1.jpg 960w, http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1-300x209.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Cư dân tại đây còn được tận hưởng bầu không khí trong lành với các công trình vui chơi công cộng ngoài trời tại Công viên Yên Sở, rộng nhất miền Bắc và trung tâm thương mại LePARC by Gamuda.</span></p>\r\n\r\n<div class=\"post-more clearfix\" style=\"box-sizing: border-box; margin: 15px 0px 0px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 18px; text-align: center; color: rgb(56, 129, 51);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Liên hệ trực tiếp&nbsp;Gamuda land Việt Nam&nbsp;để nhận&nbsp;tư vấn tốt nhất</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 18px; text-align: center; color: rgb(229, 59, 44);\"><span style=\"box-sizing: border-box; font-weight: 700;\">HOTLINE&nbsp;<img alt=\"☎\" class=\"emoji\" draggable=\"false\" src=\"https://s.w.org/images/core/emoji/2.2.1/svg/260e.svg\" style=\"box-sizing: border-box; border: none !important; vertical-align: -0.1em !important; height: 1em !important; max-width: 100%; display: inline !important; box-shadow: none !important; width: 1em !important; margin: 0px 0.07em !important; padding: 0px !important; background: none !important;\" /></span></p>\r\n</div>', '', '', 'null', 'null', 0, 0, 1, -1, 0, 0, 0, 0, 1, '', '', '', 1, 1, '2017-08-06 21:45:37', '2017-08-06 21:49:07');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images1`, `albums`, `description`, `bongda`, `content`, `content2`, `youtube`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `ishot`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(45, 'NHÀ VƯỜN CAMELLIA HOMES – LIỀN KỀ GIAI ĐOẠN 3 ST4', 'nha-vuon-camellia-homes-lien-ke-giai-doan-3-st4', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/products/st4.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; background-color: rgb(245, 245, 245);\">&nbsp;BÀN GIAO: Quý II/2018</span></p>', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 32px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tổng quan nhà liền kề ST4 – Camelia Homes</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với những ưu điểm về vị trí dự án cũng như thiết kế cảnh quan,&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;trong giai đoạn 1 và giai đoạn 2 đã tạo dấu ấn trên thị trường bất động sản phía Nam Hà Nội. Trong giai đoạn 3, Gamuda Land Việt Nam tiếp tục cho ra mắt 133 căn biệt thự liền kề với tên gọi thương mại Camelia Homes ST4 có diện tích nhỏ hơn.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><img alt=\"\" class=\"aligncenter  wp-image-1867\" height=\"522\" sizes=\"(max-width: 747px) 100vw, 747px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png 1950w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-300x210.png 300w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-1024x715.png 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"747\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Vị trí Nhà liền kề ST4 trong khu đô thị Gamuda</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Nằm trong khuôn viên Gamuda Gardens – Khu đô thị tốt nhất Hà Nội, Camelia Homes là chốn an cư lý tưởng cho những gia đình tìm kiếm không gian sống xanh mát, rời xa những ồn ào của chốn đô thị trung tâm. Những dãy nhà liền kề thiết kế hiện đại, rộng thoáng, bao bọc bởi sân trước và vườn sau, tạo thành một thể kiến trúc thống nhất và năng động. Sở hữu điểm nhấn là những đóa hoa trà duyên dáng, hài hòa và cân đối, Camelia Homes mang đến nét độc đáo, chấm phá trong quang cảnh xanh mướt tại Khu đô thị Gamuda Gardens. Mô hình kiến trúc 3 tầng trên diện tích đất từ 105m2 – 271 m2, diện tích xây dựng từ 196m2 – 204m2, cho phép gia chủ tạo dựng một không gian phù hợp cho mọi sinh hoạt gia đình và mục đích sử dụng.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter  wp-image-1869\" height=\"555\" sizes=\"(max-width: 741px) 100vw, 741px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda-300x225.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"741\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Mô hình nhà liền kề ST4</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với sân trước, vườn sau bao quanh ngôi nhà, mỗi căn liền kề ST4 đều có 3 mặt thoáng cùng hệ thống cửa sổ kính lớn giúp không gian sống của gia chủ được rộng mở, đón trọn những nguồn ánh sáng và luồng gió tự nhiên vào từng góc phòng. Mỗi tầng đều có những khoảng không gian chung của gia đình như phòng khách, phòng đọc sách hay phòng học, phòng thờ …trong khi vẫn đảm bảo những không gian riêng rộng mở như phòng ngủ lớn và nhỏ được thiết kế hài hòa.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1874\" height=\"460\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/U297gRk-300x212.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; clear: both;\" width=\"650\" />Phối cảnh thiết kế liền kề ST4</p>\r\n\r\n<div class=\"wp-caption alignnone\" id=\"attachment_3974\" style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phong Cách Sống Lành Mạnh</span></span></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Liền kề ST4 Gamuda là một ngôi vườn trong phố với không gian xanh, thanh bình của vườn cây, tiểu cảnh nước hòa mình vào những sắc xanh trong lành của công viên, đường dạo và những tiện ích cộng đồng hiện đại khác thuộc Khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1868\" height=\"449\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao-300x207.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"650\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Một góc công viên nhỏ nhà liền kề ST4 Gamuda Gardens</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mặt Bằng Tổng Thể Liền Kề ST4 Gamuda</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Khu đô thị&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;là một trong bốn khu phức hợp chính của Gamuda City, được xây dựng với mục tiêu trở thành khu dân cư có đầy đủ mọi trang thiết bị hiện đại và tiện ích cộng đồng, bao gồm câu lạc bộ giải trí, trường công và trường quốc tế, trung tâm thương mại với không gian văn phòng và kinh doanh, các cửa hàng lân cận và nhà trẻ.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Mặt Bằng Tầng &nbsp;– Căn Tiêu Chuẩn</span></span></p>\r\n\r\n<ul style=\"padding: 15px; box-sizing: border-box; margin: 0px; list-style: none; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích đất</span>&nbsp;:từ 105m2 – 428m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Diện tích xây dựng</span>&nbsp;:197m2 – 205m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng ngủ</span>: 4 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng vệ sinh</span>: 5 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phòng thờ</span>: 1 phòng</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Sở hữu</span>: Sổ đỏ vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá bán</span>: từ 45 – 60 triệu/m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá hấp dẫn chỉ từ 6,8 tỷ đến 8.5 tỷ</span></span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hoàn thiện:</span>&nbsp;Mặt ngoài và bàn giao thô</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Bàn giao:</span>&nbsp;Quý 4/2018</span></li>\r\n</ul>\r\n\r\n<div class=\"wp-caption alignleft\" id=\"attachment_4013\" style=\"box-sizing: border-box; display: inline; float: left; margin: 0.4em 1.6em 1.2em 0px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify; width: 832px;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><img alt=\"\" class=\"aligncenter  wp-image-1871\" height=\"493\" sizes=\"(max-width: 832px) 100vw, 832px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/M%E1%BA%B7t-b%E1%BA%B1ng-ST4-tung-t%E1%BA%A7ng.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng.jpg 1165w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-300x178.jpg 300w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-1024x606.jpg 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"832\" /></p>\r\n\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mặt bằng các căn tiêu chuẩn</p>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">** Giá và tiến Độ Thanh Toán :</span></span></div>\r\n\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">&nbsp;</div>\r\n\r\n<div data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9qpb2-0-0\" style=\"box-sizing: border-box;\">Giá hấp dẫn chỉ từ 6,8 tỷ/ căn tiêu chuẩn</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">Thanh toán trả chậm lên đến 3 năm không lãi suất cho chủ đầu tư Gamuda Land Việt Nam hỗ trợ.</div>\r\n\r\n<div data-offset-key=\"6i670-0-0\" style=\"box-sizing: border-box;\">&nbsp;</div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"6negc-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"6negc-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">** Chính sách ưu đãi :</span></span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9uks2-0-0\" style=\"box-sizing: border-box;\">+ Tặng 1 Chuyến du lịch cho gia đình 4 người đến Nhật Bản – Hàn Quốc trị giá 200 triệu đồng ( bao gồm VAT) được quy đổi thành chiết khấu trừ vào đợt bàn giao nhà</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"456et-0-0\" style=\"box-sizing: border-box;\">+ Tặng gói nội thất 80 Triệu trừ vào đợt thanh toán lần 1.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"9v4u0-0-0\" style=\"box-sizing: border-box;\">+ Dành cho KH thân thiết: Tặng 1 suzuki swift trị giá 550 triệu vnd đã bao gồm vat. Quy đổi thành chiết khấu và trừ vào đợt bàn giao nhà.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"dav77-0-0\" style=\"box-sizing: border-box;\">+ Tặng gói nội thất nhà thông minh Smart Home trị giá 70 Triệu. Tặng 1 năm Gói truyền hình cáp internet Và gói bảo hiểm nhà ở.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"cubgh-0-0\" style=\"box-sizing: border-box;\">+ Miễn phí 3 năm phí quản lý và 3 năm phí sử dụng câu lạc bộ.</span></div>\r\n</div>\r\n\r\n<div data-block=\"true\" data-editor=\"5000c\" data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\">\r\n<div data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\"><span data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\">+ Giảm 20% học phí Trường Liên cấp quốc tế Việt Nam – Singapore.</span></div>\r\n\r\n<div data-offset-key=\"d8vs2-0-0\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Khu Đô Thị Tốt Nhất Hà Nội</span></span></div>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Vinh dự nhận giải thưởng Bất động sản Việt Nam cho hạng mục “Khu đô thị tốt nhất Hà Nội” 2105, Gamuda Gardens được đánh giá là một Khu đô thị có quy hoạch tổng thể thông minh, giàu tính nhân văn, thiết kế chất lượng, phát triển bền vững và những giá trị cốt lõi độc đáo.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1855\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens.jpg 800w, http://gamudacity.info/wp-content/uploads/2016/06/tien-ich-biet-thu-song-lap-giai-doan2-gamuda-gardens-300x188.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Tại Gamuda Gardens, tiện nghi đã được hình thành với hệ thống hạ tầng đầy đủ và tiện ích đồng bộ như: Câu lạc bộ Gamuda Gardens với bể bơi, phòng tập gym, phòng xông hơi, sân tennis, phòng hội thảo và nhà hàng đều đã đi vào hoạt động. Trường liên cấp quốc tế Singapore (SIS) với hơn 2.000 học sinh từ tiểu học tới cấp 3.</span><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-size: 16px;\">Dự án cũng có trạm cung ứng nhiên liệu và trung tâm thương mại dịch vụ Sông Hồng, Trung tâm chăm sóc sức khỏe Ba Son, Trường mẫu giáo Little Maple và Blossoms..</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1876\" height=\"670\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1.jpg 960w, http://gamudacity.info/wp-content/uploads/2017/06/tien-ich-lien-ke-giai-doan-3-st4-gamuda-1-300x209.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Cư dân tại đây còn được tận hưởng bầu không khí trong lành với các công trình vui chơi công cộng ngoài trời tại Công viên Yên Sở, rộng nhất miền Bắc và trung tâm thương mại LePARC by Gamuda.</span></p>\r\n\r\n<div class=\"post-more clearfix\" style=\"box-sizing: border-box; margin: 15px 0px 0px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 18px; text-align: center; color: rgb(56, 129, 51);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Liên hệ trực tiếp&nbsp;Gamuda land Việt Nam&nbsp;để nhận&nbsp;tư vấn tốt nhất</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 18px; text-align: center; color: rgb(229, 59, 44);\"><span style=\"box-sizing: border-box; font-weight: 700;\">HOTLINE&nbsp;<img alt=\"☎\" class=\"emoji\" draggable=\"false\" src=\"https://s.w.org/images/core/emoji/2.2.1/svg/260e.svg\" style=\"box-sizing: border-box; max-width: 100%; border: none !important; vertical-align: -0.1em !important; height: 1em !important; display: inline !important; box-shadow: none !important; width: 1em !important; margin: 0px 0.07em !important; padding: 0px !important; background: none !important;\" /></span></p>\r\n</div>', '', '', 'null', 'null', 0, 0, 1, -1, 0, 0, 0, 0, 1, '', '', '', 1, 1, '2017-08-06 21:54:02', '2017-08-06 22:13:41'),
