(47, 'Nghệ sĩ hài Xuân Bắc bên chiếc xe điện Giant M133S+(Plus)', 'nghe-si-hai-xuan-bac-ben-chiec-xe-dien-giant-m133s-plus', '', 46, 'vietnamese', '[\"46\"]', '/uploads/images/khach-hang/a-hau-huyen-my.png', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Tri ân khách hàng là một trong những hoạt động thường niên nhằm tăng cường sự tin tưởng và hợp tác bền chặt giữa khách hàng với Traphaco trong sự nghiệp chăm sóc sức khỏe của người dân. Tiếp nối thành công của các chương trình tri ân khách hàng đã diễn ra, ngày 9-10/10/2017 chương trình tri ân khách hàng thân thiết tỉnh Hà Giang và Lạng Sơn đã diễn ra thành công tốt đẹp và nhận được những tình cảm của quý khách. Sự tin tưởng của khách hàng chính là nguồn động lực to lớn, thôi thúc những con người Traphaco sáng tạo Dược phẩm xanh bảo vệ sức khỏe con người</p>', '', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; border: 2px dashed red; margin: 10px 0px; border-radius: 5px; padding: 10px; background-color: rgb(255, 255, 200);\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-size: 14px; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;<span style=\"box-sizing: inherit; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Tiến Độ Thanh Toán:</strong></span></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng lựa chọn 1 trong hai hình thức thanh toán như sau :</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng được Ngân Hàng hỗ trợ vay vốn lãi suất 0% đến lúc nhận nhà và nhận chiết khấu 5%.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng được trả chậm 48 tháng&nbsp;0% lãi suất kể từ lúc nhận nhà vào ở.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 14px;\"><strong style=\"box-sizing: inherit;\">&nbsp; &nbsp; Khuyến Mãi Chung:</strong></span></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tri ân khách hàng chiết khấu 500 Triệu trừ vào đợt bàn giao nhà&nbsp;chỉ áp dụng trong tháng 08/2017.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">.</span><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với những căn góc diện tích&nbsp;&gt;180m2: Được chiết khấu thêm 2% trừ vào đợt bàn giao.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 2&nbsp;năm phí quản lý khu đô thị&nbsp;và 2 năm phí sử dụng câu lạc bộ Clubhouse.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n</div>\r\n\r\n<h1 style=\"line-height: 1.1; box-sizing: inherit; font-size: 2.57em; margin: 0.67em 0px; clear: both; font-family: Roboto, sans-serif; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 14pt; color: rgb(0, 128, 0);\">Tổng quan nhà Liền kề Gamuda giai đoạn 2</span></strong></span></h1>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giai đoạn mới được thiết kế hiện đại 3 tầng, với 4 hướng chủ đạo là chính Bắc, Chính Nam, Đông Bắc và Tây Nam. Mặt tiền rộng 5,5m như thiết kế liền kề giai đoạn 1 nhưng ấn tượng hơn với những mảng màu đối lập mạnh tạo điểm nhấn cho ngôi nhà. Thêm vào đó là 2 ban công rộng rãi trên tầng 2 và tầng 3. &nbsp;Sân và vườn của thiết kế mới rộng hơn tạo cho cư dân có đầy đủ khoảng không và không gian thiết kế những tiểu cảnh phù hợp với sở thích của mình.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><img alt=\"lien-ke-gamuda-st3-garden-homes\" class=\"alignnone size-full wp-image-1673\" height=\"476\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/lien-ke-gamuda-st3-garden-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/lien-ke-gamuda-st3-garden-homes.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/lien-ke-gamuda-st3-garden-homes-300x168.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/lien-ke-gamuda-st3-garden-homes-768x430.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh khu nhà liền kề Giai đoạn 2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các căn liền kề Garden Homes có Diện tích đất từ 115m2-152m2, diện tích xây dựng lên tới 220m2. Hiện 124 căn đã hoàn thiện xong phần khung 3 tầng, dự kiến bàn giao cho khách hàng vào cuối năm 2017.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"khu-lien-ke-giai-doan-2\" class=\"alignnone wp-image-733 size-full\" height=\"1024\" sizes=\"(max-width: 763px) 100vw, 763px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khu-lien-ke-giai-doan-2.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khu-lien-ke-giai-doan-2.png 763w, http://gamudagardens.vn/wp-content/uploads/2016/08/khu-lien-ke-giai-doan-2-224x300.png 224w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"763\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng tổng thể khu liền kề giai đoạn 2</span></p>\r\n\r\n<h3 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\">Thiết kế Nhà liền kề ST3 Garden Homes</span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Ro