INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images1`, `albums`, `description`, `bongda`, `content`, `content2`, `youtube`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `ishot`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(48, 'Nghệ sĩ hài Xuân Bắc bên chiếc xe điện Giant M133S+(Plus)', 'nghe-si-hai-xuan-bac-ben-chiec-xe-dien-giant-m133s-plus', '', 46, 'vietnamese', '[\"46\"]', '/uploads/images/khach-hang/khahc-hang-03.png', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Tri ân khách hàng là một trong những hoạt động thường niên nhằm tăng cường sự tin tưởng và hợp tác bền chặt giữa khách hàng với Traphaco trong sự nghiệp chăm sóc sức khỏe của người dân. Tiếp nối thành công của các chương trình tri ân khách hàng đã diễn ra, ngày 9-10/10/2017 chương trình tri ân khách hàng thân thiết tỉnh Hà Giang và Lạng Sơn đã diễn ra thành công tốt đẹp và nhận được những tình cảm của quý khách. Sự tin tưởng của khách hàng chính là nguồn động lực to lớn, thôi thúc những con người Traphaco sáng tạo Dược phẩm xanh bảo vệ sức khỏe con người</p>', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">Mỗi căn nhà ở khu đô thị&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;có 4 phòng ngủ , được bố trí ở các tầng 2 và 3 . Các phòng ngủ thường được hướng về phía trước và phía sau , ưu điểm là view nhìn rộng , không gian thoáng đãng , đón được lượng gió , không khí và ánh sang mặt trời tốt nhất mang lại sức khỏe và tinh thần thư giãn nhất cho mọi thành viên trong gia đình .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">– Diện tích đất từ 118m2 , diện tích xây dựng gồm 2 loại , 58 m2/ sàn và 75 m2/ sàn , xây 3 tầng , mặt tiền 5,5 m . Bao gồm phòng khách , phòng ăn , phòng bếp , 4 phòng ngủ , 1 phòng ở cho người giúp việc , phòng học , phòng thờ hoặc phòng sinh hoạt chung , 5 WC , chỗ đỗ ô tô , sân vườn trước sau .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">– Tình trạng bàn giao : Nhà xây kiên cố 3 tầng theo tiêu chuẩn Conquas ( Singapore ) , hoàn thiện bên ngoài , xây ngăn phòng bên trong .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">– Hiện nay , tất cả biệt thự , nhà liền kề tại&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;xây dựng hoàn thành 100% và bàn giao cho cư dân từ tháng 4/2014 .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">Ký hợp đồng trực tiếp với chủ đầu tư , cấp sổ đỏ sở hữu vĩnh viễn .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">Nhà liền kề loại tiêu chuẩn &nbsp;( loại 75 m2 / sàn ) được thiết kế độc đáo với một &nbsp;khoảng giếng trời nhỏ tại trung tâm ngôi nhà , mang lại đến nguồn sáng tự nhiên và những luồng gió mát cho không gian bên trong các phòng &nbsp;. Mặt tiền nhà ấn tượng với vẻ ngoài hiện đại cùng cách phối mầu và và chất liệu đầy sáng tạo . Không gian sân thượng cho phép gia chủ thưởng lãm &nbsp;cảnh quan công viên xanh mát của&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\"><img alt=\"\" class=\"alignnone size-full wp-image-597 aligncenter\" height=\"528\" sizes=\"(max-width: 640px) 100vw, 640px\" src=\"http://gamuda.net/wp-content/uploads/2017/06/Lien-ke-Gamuda-Gardens1.png\" srcset=\"http://gamuda.net/wp-content/uploads/2017/06/Lien-ke-Gamuda-Gardens1.png 640w, http://gamuda.net/wp-content/uploads/2017/06/Lien-ke-Gamuda-Gardens1-300x248.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"640\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(248, 248, 248); text-align: center;\">Nhà liền kề&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;– Tiểu khu Botanic</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">Loại hình nhà liền kề nhỏ ( 58 m2 / sàn ) luôn bừng sáng với nguồn sáng tự nhiên nhờ hệ thống của sổ lớn bằng kính . Không gian chung được thiết kế thoáng rộng và thân thiện , phù hợp với mục đích để giải trí của cả &nbsp;gia đình . Kiến trúc mặt tiền giúp làm nổi bật cá tính độc đáo của mỗi ngôi nhà với cách sử lý hiện đại cho những kiến trúc pháp cổ điển , ghi dấu qua các khung cửa sổ và ban công .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\"><img alt=\"\" class=\"alignnone size-full wp-image-605 aligncenter\" height=\"394\" sizes=\"(max-width: 630px) 100vw, 630px\" src=\"http://gamuda.net/wp-content/uploads/2017/06/nha-lien-ke-gamuda-gardens-phong-khach.jpg\" srcset=\"http://gamuda.net/wp-content/uploads/2017/06/nha-lien-ke-gamuda-gardens-phong-khach.jpg 630w, http://gamuda.net/wp-content/uploads/2017/06/nha-lien-ke-gamuda-gardens-phong-khach-300x188.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"630\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(248, 248, 248); text-align: center;\">phòng khách nhà liền kề&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\">Nhà liền kề&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;loại nhỏ gây ấn tượng bởi phong cách thiết kế lịch lãm , trang nhã từ mặt tiền , thể hiện qua bố cục gọn gàng , thanh mảnh , sự phối kết hợp ăn ý giữa mầu sắc với chất liệu ở bề ngoài sẽ tạo cho bạn một cảm xúc lạ lẫm ,mới mẻ trước khi bước vào không &nbsp;gian thoáng đãng , sang trọng của cấu trúc bên trong . Khuôn viên rộng lớn , kiến trúc hòa quyện giá trị truyền thống , tôn vinh giá trị hiện đại sẽ thỏa mãn được những đòi hỏi khắt khe về mặt thẩm mĩ của những khách hàng khó tính .&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: justify; background-color: rgb(248, 248, 248);\"><a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda Gardens</a>&nbsp;dường như là trọng tâm của dự án khi là nơi hội tụ của những hoạt động trung tâm và những loại hình căn hộ nổi bật của&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(189, 114, 43); text-decoration-line: none; cursor: pointer; transition: all 0.25s ease-in-out; outline: 0px;\">Gamuda City</a>&nbsp;: biệt thự song lập , nhà liền kề , căn hộ chung cư , biệt thự đơn lập . Mời quý khách tham khảo một số thông ti