pan></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"phong-ngu-nho-lien-ke-gamuda\" class=\"alignnone wp-image-865 size-full\" height=\"531\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-nho-lien-ke-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-nho-lien-ke-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-nho-lien-ke-gamuda-300x199.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-nho-lien-ke-gamuda-768x510.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-nho-lien-ke-gamuda-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Phòng ngủ ngập tràn ánh nắng\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ đón nhận nhiều ánh sáng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Liên hệ phòng kinh doanh Gamuda Land Việt Nam</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvet