INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images1`, `albums`, `description`, `bongda`, `content`, `content2`, `youtube`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `ishot`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(53, 'Người phụ nữ về hưu và kinh nghiệm để bệnh viêm xoang nhanh khỏi', 'nguoi-phu-nu-ve-huu-va-kinh-nghiem-de-benh-viem-xoang-nhanh-khoi', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/img-post-5.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Các triệu chứng như hắt hơi nhiều, ngạt mũi, sổ mũi người ta thường bị nhầm lẫn đối với chứng cảm cúm thông thường. Nhưng rất nhiều trường hợp, có thể đây là những biểu hiện điển hình của bệnh viêm xoang dị ứng</p>', '', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Gamuda Land Mở bán 23 Căn Biệt thự Đơn lập khu đô thị Gamuda Gardens&nbsp;</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit; border: 2px dashed red; margin: 10px 0px; border-radius: 5px; background-color: rgb(255, 255, 200); padding: 10px;\">\r\n<div style=\"box-sizing: inherit; margin-left: 18pt;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">Tiến Độ Thanh Toán:</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thanh toán trả chậm 3&nbsp;năm 0% lãi suất.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng được Chủ Đầu Tư hỗ trợ tự xây theo thiết kế riêng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">Khuyến Mãi Chung:</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 3 năm phí quản lý và 3 năm phí sử dụng câu lạc bộ Clubhouse.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-don-lap-gamuda-gardens\" class=\"alignnone wp-image-851 size-full\" height=\"533\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự gamuda gardens\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà mẫu biệt thự đơn lập Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Biệt thự đơn lập Gamuda có gì cho bạn?</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Biệt thự đơn lập Gamuda hay còn gọi là biệt thự Mansions – một thiết kế tinh tế và đẳng cấp dành cho các chủ nhân ưa thích không gian sống thanh bình theo phong cách nghỉ dưỡng.</span><br style=\"box-sizing: inherit;\" />\r\n<span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đúng như tên gọi “Mansions”, mỗi căn biệt thự có một không gian mở với sân phía trước, vườn nằm phía sau, tiểu cảnh bên hiên nhà, ôm trọn cuộc sống của gia chủ trong sự thoải mái và giao hòa cùng thiên nhiên. Tầng một với phòng khách, phòng ăn, bếp khô và bếp ướt cùng phòng ngủ cho người già. trong khi các tầng trên là các phòng ngủ riêng khéo léo kết hợp với các không gian chung như phòng khách nhỏ, phòng sinh hoạt chuoung, góc làm việc và đọc sách, góc thư giãn ngoài ban công.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-don-lap-gamuda-gardens\" class=\"alignnone wp-image-879 size-full\" height=\"600\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1-300x225.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1-768x576.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự đơn lập Gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt trước biệt thự Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Tận dụng lợi thế của một</span>&nbsp;biệt thự đơn lập&nbsp;<span style=\"box-sizing: inherit;\">với 4 mặt thoáng, thiết kế công năng của tất cả các phòng và khu vực chức năng đều tận dụng tối đa nguồn ánh sáng và gió tự nhiên. Điểm nhấn của biệt thự Gamuda nằm ở khu vực giếng trời chính giữa ngôi nhà, vừa thể hiện ý đồ kiến trúc, vừa luân chuyển nguồn năng lượng, điều hòa không khí và ánh sáng cho toàn bộ căn nhà.</span></span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Thiết kế của Biệt Thự Đơn Lập có gì hấp dẫn</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế độc đáo, khoa học với không gian mở vẫn là những ưu điểm chính trong cách thiết kế tại Biệt thự Gamuda Garden :</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"mat-bang-biet-thu-gamuda\" class=\"alignnone wp-image-460 size-full\" height=\"534\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-768x513.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Mặt bằng thiết kế biệt thự đơn lập\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế các tầng biệt thự đơn lập</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"mat-bang-khu-biet-thu-don-lap-gamuda\" class=\"alignnone\" data-id=\"1497\" height=\"767\" src=\"http://gamudacityhanoi.com/media/1248/khu-biet-thu-don-lap-gamuda-garden.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Mặt bằng khu biệt thự đơn lập\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng khu biệt thự đơn lập</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật:</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất : 288m2-500m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 3 tầng: 408m2 – 418 m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước: Mặt tiền từ 12-18m. Chiều sâu nhà : 24m</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 5 phòng + 1 phòng ngủ cho giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng tắm: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tầng hầm : 01 hầm</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thời hạn sử dụng đất: Sổ đỏ vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầy đủ các hướng: Bắc, Đông Bắc, Tây Nam, Tây Bắc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 56 đến 65 triệu/m2( Tùy từng vị trí và diện tích) chưa trừ chiết khấu.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ngoài ra khách hàng có thể tự thiết kế mẫu biệt thự cho mình.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Hoàn thiện xong&nbsp;hạ tầng, đã bàn giao mặt bằng cho khách hàng tự xây dựng.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">LIÊN HỆ TRỰC TIẾP PHÒNG DỰ ÁN GAMUDA</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Hình ảnh thực tế của biệt thự đơn lập Gamuda Gardens</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-