(54, 'Nguy hại bệnh đường hô hấp tái phát lúc giao mùa', 'nguy-hai-benh-duong-ho-hap-tai-phat-luc-giao-mua', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/img-post-4.jpg', '', '\"\"', '<p>Là Thương hiệu dẫn đầu ngành dược, Traphaco luôn lấy lợi ích cộng đồng làm khởi sự cho mọi hoạt động, Traphaco đã có những đóng góp tích cực cho sự phát triển chung của toàn xã hội. Traphaco vinh dự được nhận rất nhiều danh hiệu, giải thưởng cao quý.</p>', '', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT CHO SẢN PHẨM SHOPHOUSE THE ONE CENTRAL</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thanh toán 50% theo tiến độ xây dựng đến khi nhận nhà, 50% còn lại thanh toán trả chậm trong vòng 2-5 năm;0% lãi suất.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung:</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 01 &nbsp;năm phí sử dụng câu lạc bộ Clubhouse.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tri ân khách hàng 2- 7% chỉ áp dụng đến 31/9/2016.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với Block 3 khách hàng được hoàn thêm 434 triệu tiền xây dựng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhằm đem lại nhiều hơn nữa những tiện ích sẵn có cho cư dân khu đô thị Gamuda Gardens, chủ đầu tư Gamuda Land Việt Nam giới thiệu khu nhà phố thương mại The ONE Central với mô hình hoàn toàn mới tại Việt Nam – Mô hình nhà phố khởi nghiệp.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"the-one-central-shophouse\" class=\"alignnone size-full wp-image-1283\" height=\"450\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-300x169.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-768x432.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh Nhà phố Kinh doanh The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tọa lạc tại một trong những vị trí chiến lược nhất của khu đô thị&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>, một mặt hướng ra đường Vành đai 3, The ONE Central với 44 căn nhà phố bao quanh chung cư The ONE Residence sẽ cung cấp tiện ích không chỉ cho hơn 600 hộ gia đình sống tại chung cư mà còn gần 1000 giáo viên, học sinh trường liên cấp quốc tế Singapore. Giờ đây, chỉ cách vài bước đi bộ, cư dân hoàn toàn có thể trải nghiệm các dịch vụ đẳng cấp sẵn có mà không cần phải đi đâu xa.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">&nbsp;<img alt=\"vi-tri-nha-pho-thuong-mai-the-two-cen-tral\" data-id=\"1692\" src=\"http://gamudacityhanoi.com/media/1407/vi-tri-shop-house-gamuda.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí dãy Nhà Phố số 1 The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hướng tới những doanh nghiệp trẻ mới khởi nghiệp và những công ty gia đình quy mô nhỏ, The&nbsp;ONE&nbsp;Central đem đến một không gian sống kết hợp kinh doanh linh hoạt với diện tích thiết thực cho giai đoạn khởi đầu. Toàn bộ nửa trước ngôi nhà sẽ được hoàn thiện với kết cấu hợp lý trong khi nửa không gian trống phía sau được thiết kế mở để các gia đình thỏa sức sử dụng theo nhu cầu riêng. Đó có thể là quầy café-bar ngoài trời hoặc khu vui chơi nhỏ cho trẻ em. Và bất cứ khi nào cần, gia chủ có thể hoàn thiện nốt mà vẫn đảm bảo không phá vỡ kết cấu của ngôi nhà. Kiểu thiết kế này giúp người mua tối ưu hóa diện tích xây dựng khi chưa có nhu cầu sử dụng toàn bộ, đưa lại mức chi phí hợp lý hơn, giảm thiểu áp lực kinh tế trong giai đoạn khởi đầu.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"the-one-central-shop-house-gamuda\" data-id=\"1697\" src=\"http://gamudacityhanoi.com/media/1411/the-one-central-gamuda-gardens.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không chỉ vậy, The ONE Central được thiết kế linh hoạt với từng đường nét, họa tiết, chất liệu mang hơi hướng tối giản mà hiện đại, hài hòa với cảnh quan thiên nhiên và kiến trúc của những hạng mục khác. Khu nhà phố này được dự kiến bàn giao cho khách hàng và sẵn sàng đi vào hoạt động từ giữa năm 2017, ngay sau khi hoàn thiện chung cư The ONE Residence.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tiem-nang-kinh-doanh-shophouse-gamuda\" data-id=\"1693\" src=\"http://gamudacityhanoi.com/media/1408/tien-nang-shop-house-gamuda.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiềm năng của Nhà phố thương mại Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The One Central: tiềm năng không thua kém so với The Three Central, The One Central mặc dù đang trong quá trình xây dựng song nơi đây cũng được đánh giá là điểm đầu cơ sinh lời hấp dẫn trong tương lai. Theo đó The One Central sẽ là nơi cung cấp đầy đủ tiện nghi cho một cộng đồng&nbsp; văn minh, hiện đại bao gồm 15000 cư dân có mức thu nhập cao tại Gamuda Gardens, gấn 1000 học sinh và giáo viên của trường quốc tế SIS Singapore, hơn 600 hộ gia đình tại khu căn hộ The One Residence.. và phục vụ lượng lớn khách hàng sinh sống tại khu vực lân cận quận Hoàng Mai cũng như di chuyển trên đường Vành đai 3.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khởi công : Quý I/2015.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dự kiến bàn giao : Quý IV/2016.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng số căn : 44 căn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất: Từ 127 – 133 – 388m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 4 tầng: Từ 260 – 340 – 944 m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bố trí tầng : Tầng 1 và tầng 2 để kinh doanh, tầng 3 và tầng 4 để ở.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước tiêu chuẩn : 5.5 X 23.5 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ&nbsp;90 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng giá : Từ&nbsp;10.5 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao cơ bản.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 65 %</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"mat-bang-thiet-ke-nha-pho-gamuda-the-one-central\" data-id=\"1690\" src=\"http://gamudacityhanoi.com/media/1402/mat-bang-nha-pho-gamuda-the-one-central.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế nhà phố The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"vi-tri-shophhouse-gamuda-gardens\" data-id=\"1696\" src=\"http://gamudacityhanoi.com/media/1410/vi-tri-shophouse-gamuda-the-one-central.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Sắp xếp các căn Nhà phố The One Central</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Tiến độ thanh toán</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 1: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần móng và ký kết Hợp Đồng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">(Thanh toán các đợt theo tiến độ xây dựng – Có thông báo khi hoàn thành các hạng mục trước 21 ngày.)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 2: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần khung bê tông, cốt thép của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 3: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần tường của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 4: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần mái và các phần che phủ của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 5: Thanh toán 5% giá trị HĐMB – Ngay sau khi hoàn thành phần trát bên ngoài của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 6: Thanh toán 5% giá trị HĐMB – Ngay sau khi hoàn thành hệ thống đường phục vụ cho căn nhà</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 7: Thanh toán 25% giá trị HĐMB – Ra thông báo bàn giao và hệ thống điện nước của căn nhà đã sẵn sang kết nối.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 8: Thanh toán 10% giá trị HĐMB – 30 ngày kể từ ngày bàn giao theo thông báo.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 9: Thanh toán 10% giá trị HĐMB – 60 ngày kể từ ngày bàn giao theo thông báo.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 10: Thanh toán 5% giá trị HĐMB – Nhận sổ đỏ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The One Central đang trong giai đoạn mở bán những đợt đâu tiên. Hãy nhanh tay là những khách hàng đầu tiên sở hữu những căn nhà phố có vị trí đẹp nhất và được chiết khấu lên tới 6% cho những khách hàng đầu tiên.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Tiến độ&nbsp;xây dựng</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các căn Nhà phố đang có tiến độ tốt. Sẽ bàn giao cho cư dân cùng thời điểm bàn giao Chung cư The One Residence. Thời gian bàn giao vào quý IV/2016</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tien-do-xay-dung-nha-pho-thuong-mai-gamuda\" data-id=\"1694\" src=\"http://gamudacityhanoi.com/media/1409/tien-do-day-nh-pho-gamuda-the-one-central.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà phố The One đã xong khung và Chung cư The One Residence đang hoàn thiện</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Liên hệ để nhận&nbsp;thêm thông tin chi tiết</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>', '530', '', 'null', 'null', 0, 0, 1, 0, 0, 1, 0, 0, 1, '', '', '', 1, 3, '2017-08-06 23:15:19', '2017-11-28 09:29:31');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images1`, `albums`, `description`, `bongda`, `content`, `content2`, `youtube`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `ishot`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(55, 'Dấu hiệu khi ho cảnh báo bệnh nguy hiểm ở trẻ', 'dau-hieu-khi-ho-canh-bao-benh-nguy-hiem-o-tre', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/img-post-3.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Cống hiến cho xã hội những sản phẩm - dịch vụ mang tính thời đại và giàu giá trị truyền thống, nhằm nâng cao chất lượng cuộc sống.</p>', '', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT CHO SẢN PHẨM SHOPHOUSE THE TWO&nbsp;CENTRAL</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Khách hàng thanh toán trả chậm trong vòng 3 năm 0% lãi suất.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung&nbsp;</strong>:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chiết khấu 5% chỉ trong tháng 07/2017</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ưu đãi kỷ niệm 10 năm thành lập Gamuda Land tại Việt Nam&nbsp;Tặng 10 xe Libety và&nbsp;nhiều phần quà có giá trị.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Tặng 1 năm phí sử dụng câu lạc bộ Clubhouse.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Miễn giảm 10% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Shophouse là một loại hình nhà ở kết hợp với cửa hàng&nbsp;kinh doanh, loại hình&nbsp;này chỉ mới xuất hiện tại Việt Nam cách đây vài năm, nhưng hiệu quả đầu tư lại khá cao. Thông thường Shophouse có ưu điểm về thiết kế&nbsp;sẻ khe đem lại nhiều không gian sử dụng. Các căn hộ shophouse có một hoặc hai mặt tiền trong những dự án chung cư cao tầng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trong khu đô thị Gamuda Các căn hộ Shophouse có tiềm năng kinh doanh rất lớn khi phục vụ hơn 12000 cư dân có thu nhập cao trong Khu đô thị. Ngoài ra Môi trường sống tốt cũng như tiện ích đồng bộ vẫn là lựa chọn hoàn hảo cho một tổ ấm tại nơi đây.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Vị trí Shophouse Gamda trong khu đô thị&nbsp;</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"vi-tri-shophouse-gamuda-gardens\" class=\"alignnone size-full wp-image-1573\" height=\"557\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens-300x209.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens-768x535.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Vị trí Dãy nhà Phố The Two Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Tọa lạc tại một trong những vị trí chiến lược nhất của khu đô thị</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>,&nbsp;<span style=\"box-sizing: inherit;\">một mặt hướng ra đường Vành đai 3, mặt còn lại hướng vào tòa nhà Chung cư The Two Residence 550 căn hộ với khoảng 2000 cư dân sinh sống.</span></span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Ưu điểm của các căn nhà Phố The Two Central</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Diện tích căn hộ đa dạng với chỉ từ 7 tỷ/căn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Vừa có thể để ở vừa có thể kinh doanh, làm Văn phòng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Cơ hội kinh doanh lớn khi phục vụ tới 15000 Cư dân có mức thu nhập cao trong Khu đô thị</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Tận hưởng mọi tiện tích trong khu đô thị Gamuda Gardens như khu nhà Clubhouse, trường học quốc tế, bệnh viện quốc tế, khu bể bơi, sân chơi thể thao…</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tiem-nang-nha-pho-thuong-mai-gamuda\" class=\"alignnone size-full wp-image-1575\" height=\"592\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"http://gamudagardens.vn/wp-content/uplo