<h2 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: inherit; color: inherit;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\">Trường học quốc tế SIS</span></strong></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Trường liên kết cấp quốc tế SIS Singapore&nbsp;được thành lập từ dự án Gamuda Gardens dưới hình thức kí kết giữa 2 tập đoàn Gamuda và tập đoàn giáo dục KinderWorld. Tọa lạc trên diện tích đất 2,3 hecta thuộc khu đô thị Gamuda Gardens, Hoàng Mai, Hà Nội. Trường liên cấp quốc tế Singapore dự kiến sẽ đào tao ra hơn 2000 học sinh từ mẫu giáo tới dự bị đại học.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Hiện tại trường SIS trong&nbsp;khu&nbsp;<a href=\"http://kdtgamudacity.com\">đô thị Gamuda</a>&nbsp;đã đi vào hoạt động từ tháng 6/2015</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-2\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-2-0\" style=\"box-sizing: border-box; min-height: 1em; width: 586.578px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"3\" id=\"panel-12-2-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: inherit; color: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 12pt;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Clubhouse Gamuda với đầy đủ tiện ích cho cư dân giải trí</span></strong></span></h2>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bể bơi tiêu chuẩn Olympic</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu chơi thể thao, Phòng tập Gym, xông hơi…</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng hội nghị Với diện tích 500m2 với sức chứa lên tới 300 khách để các bạn có thể tổ chức sự kiện, hội nghị, hội thảo hay diễn thuyết.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà hàng sang trọng .</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-2-1\" style=\"box-sizing: border-box; min-height: 1em; width: 583.406px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"4\" id=\"panel-12-2-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"khu-tiep-khach-trong-cub-house\" class=\"so-widget-image\" height=\"538\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong