(86, 'Hắt hơi nhiều, ngạt mũi, sổ mũi: Uống thuốc cảm cúm là đúng hay sai ?', 'hat-hoi-nhieu-ngat-mui-so-mui-uong-thuoc-cam-cum-la-dung-hay-sai', '', 17, 'vietnamese', '[\"17\",\"44\"]', '/uploads/images/bai-viet/img-post-1.jpg', '', '\"\"', '<p>Với hơn 44 năm xây dựng, Traphaco đã kế thừa truyền thống và phát triển nền y học cổ truyền lên một tầm cao mới bằng công nghệ hiện đại, bằng tài trí của người Việt, gánh vác sứ mệnh phục vụ sức khỏe cộng đồng, vững bước tương lai trên “Con đường Sức khỏe Xanh”.</p>', '', '<p>Được thành lập từ năm 1996 với tiền thân là Trung tâm nội thất văn phòng, gia đình, trường học, sau hơn 20 năm hình thành và phát triển, công ty Ngọc Diệp đã trở thành một trong những Công ty hàng đầu về sản xuất và cung ứng các sản phẩm Nội thất</p>', '150', '', 'null', 'null', 0, 0, 1, 1, 0, 0, 0, 0, 1, '', '', '', 3, 3, '2017-09-28 09:41:58', '2019-03-04 14:59:26'),
(87, 'Uống sữa đậu nành mỗi ngày có tốt cho sức khỏe không?', 'uong-sua-dau-nanh-moi-ngay-co-tot-cho-suc-khoe-khong', '', 17, 'vietnamese', '[\"17\",\"45\"]', '/uploads/images/bai-viet/hat-hoi-agat-moi-so-mui.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>“Sức khỏe của mẹ và bé yêu vô cùng quan trọng trong suốt quá trình mang thai, sinh nở. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết.”</p>', '', '<p>“Nullam dolor sapien, egestas pharetra quam sed, blandit efficitur nunc. Nunc vel lacus quam. Sed bibendum dui et nibh pellentesque, eget dignissim arcu mollis. Pellentesque gravida eu lorem non ornare. Pellentesque et finibus lorem.“</p>', '', '', 'null', 'null', 0, 6, 1, 0, 0, 0, 0, 0, 1, '', '', '', 3, 3, '2017-09-28 09:45:57', '2019-03-05 09:26:02'),
(88, 'Lorem ipsum dolor sit amet, consectetur', 'lorem-ipsum-dolor-sit-amet-consectetur', '', 17, 'vietnamese', '[\"16\",\"17\",\"47\",\"28\",\"33\",\"44\",\"45\"]', '/uploads/images/bai-viet/images-post(1).jpg', '', '\"\"', '<p>Orem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas a felis ac elit tristique pharetra. Curabitur quis massa interdum, maximus dolor sed, accumsan orci. Mauris placerat eget magna eu rhoncus.</p>', '', '<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Sao tôi phải thí nghiệm thiết bị điện sau khi lắp đặt?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Thí nghiệm thiết bị điện sau khi lắp đặt (SAT) thường được một đơn vị thứ 3 thực hiện. Việc này đảm bảo đưa ra được kết luận độc lập trung thực cho Chủ đầu tư và đưa thiết bị vào vận hành đúng theo thiết kế và quy định.&nbsp; Với hệ thống biên bản kết quả thí nghiệm đầy đủ, đạt tiêu chuẩn là điều kiện cần để bên Phân phối điện (được hiểu là EVN, bao gồm các đơn vị quản lý thành viên) nghiệm thu cho phép kết nối và đóng điện cung cấp cho công trình (xem mục download: Thông tư 32/2010/TT-BCT – Quy định hệ thống điện phân phối – phê duyệt 15/09/2010).</p>\r\n\r\n<p style=\"text-align: justify;\">Đối với các thiết bị điện cao áp có kết nối tới Hệ thống điện quốc gia hoặc hệ thống điện do đơn vị khác quản lý cần phải được thí nghiệm đầy đủ các hạng mục theo quy định để đảm bảo thiết bị được đạt các tiêu chuẩn quy định, lắp đúng quy chuẩn, khi làm việc không ảnh hưởng đến tính ổn định, an toàn và tin cậy của lưới điện chung. Những hạng mục thí nghiệm bắt buộc được quy định trong luật, quy phạm vận hành và tiêu chuẩn thiết bị. Ngoài ra, các hạng mục thí nghiệm đặc biệt có trong những điều khoản bổ xung của hợp đồng cung cấp thiết bị nhưng không quy định trong luật chung. Những hạng mục thí nghiệm này có thể sử dụng để đánh giá chất lượng của thiết bị, sự khác nhau của mỗi nhà sản xuất, giá thiết bị.</p>\r\n\r\n<p style=\"text-align: justify;\">Kết quả thí nghiệm thiết bị sau lắp đặt (SAT) được so sánh với thí nghiệm tiêu chuẩn và chất lượng khi xuất xưởng (FAT)&nbsp; đảm bảo thiết bị đã được lắp đặt đúng theo thiết kế từ nhà chế tạo. Hệ thống thông số kết quả thí nghiệm FAT, SAT và thí nghiệm định kỳ trong thời gian vận hành của thiết bị sẽ là cơ sở dữ liệu không thể thiếu để bạn quản lý vận hành hệ thống trong thời gian dài cũng như giúp bạn biện hộ trong các trường hợp tranh cãi về bảo hành thiết bị cũng như liên quan tới các công ty bảo hiểm hay pháp luật khi có sự cố xảy ra.</p>\r\n\r\n<p style=\"text-align: justify;\">Tham khảo thêm Luật điện lực.</p>\r\n\r\n<p style=\"text-align: justify;\">Quy chuẩn kỹ thuật quốc gia về kỹ thuật điện _ Tập 5</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi phải làm gì khi đã ký hợp đồng trọn gói với nhà cung cấp hàng?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Thí nghiệm thiết bị điện sau khi lắp đặt thường được được một đơn vị thứ 3 thực hiện trước khi đóng điện đưa vào vận hành nhằm đảm bảo đưa ra được kết luận độc lập trung thực cho chủ đầu tư và giúp nhà cấp hàng đưa thiết bị vào vận hành đúng theo thiết kế.</p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"/uploads/images/images-post-detail.jpg\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Đối với các thiết bị điện có kết nối với hệ thống điện quốc gia hoặc do đơn vị khác quản lý cần phải được thí nghiệm đầy đủ các hạng mục theo quy định để đảm bảo các thiết bị được lắp đúng quy chuẩn khi làm việc không ảnh hưởng đến tính ổn định và tin cậy của lưới điện chung. Bạn phải xác định rõ trong hợp đồng lđơn vị sẽ tiến hành thí nghiệm thiết bị sau khi lắp đặt phải đảm bảo có đầy đủ chức năng và chứng nhận tiêu chuẩn hành nghề. Hồ sơ kết quả thí nghiệm của họ được phía quản lý hệ thống điện coi là hợp lệ trước khi cho phép đấu nối và đóng điện vào hệ thống điện chung, hệ thống điện Quốc gia.</p>\r\n\r\n<p style=\"text-align: justify;\">Tham khảo thêm.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tại sao với một loại thiết bị từ các nhà sản xuất khác nhau giá tiền rất khác nhau mà kết quả thí nghiệm sau lắp đặt lại giống nhau?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Thí nghiệm sau lắp đặt tại hiện trường với mục đích kiểm tra các thông số tiêu chuẩn phải nằm trong dải thông số quy định chung, đảm bảo khi đóng điện vận hành không xảy ra sự cố và phù hợp khi so sánh với thông số thử nghiệm thiết bị khi xuất xưởng của nhà sản xuất. Tuy nhiên, thí nghiệm này chỉ một phần để có thể đánh giá được chất lượng thiết bị.</p>\r\n\r\n<p style=\"text-align: justify;\">Chất lượng của thiết bị ngoài các phép thí nghiệm đặc biệt riêng cho mỗi loại, mà còn được đánh giá bởi hệ thống thông số quá trình vận hành&nbsp; liên quan đến già hóa, tuổi thọ thiết bị, sự sai lệch với các thông số ban đầu, trong đó có cả các thống kê tần xuất hư hỏng, hệ số tổn hao công suất, sai số đo lường…</p>\r\n\r\n<p style=\"text-align: justify;\">ETRC có thể thực hiện đầy đủ để có cơ sở dữ liệu để có phân tích đánh giá thiết bị cũng như có những phép thử để đánh giá tổn hao và hiệu suất của thiết bị khi vận hành. Chúng tôi có những chuyên gia tuyệt vời, với kinh nghiệm lâu năm, đã làm việc trên hầu hết thiết bị của các hãng nổi tiếng thế giới cũng như thiết bị mới nhất có trên thị trường.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi là người quản lý vận hành hệ thống điện trong doanh nghiệp tôi phải làm gì?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Là người quản lý và vận hành thiết bị điện trong nhà máy, bạn cần đảm bảo các thiết bị an toàn cho bản thân và đồng nghiệp, ngoài ra còn chịu trách nhiệm tư vấn, gửi các yêu cầu kiểm tra kỹ thuật định kỳ, kế hoạch đại tu, trung tu thiết bị theo quy chuẩn vận hành đến chủ doanh nghiệp phê duyệt kế hoạch và ngân sách thực hiện để đảm bảo các điều kiện kỹ thuật bắt buộc này. Bạn sẽ tránh khỏi bị đánh giá, kỷ luật hoặc sa thải khi đưa ra các yêu cầu chính đáng đến lãnh đạo xem xét quyết định thực hiện, giúp doanh nghiệp hạn chế rủi ro, cũng như khi có sự cố xảy ra bất khả kháng mà nguyên nhân không phải là do không được báo trước khi không có chương trình kiểm tra thí nghiệm định kỳ thiết bị.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Việc kiểm tra thí nghiệm trong quá trình lắp đặt điện là yêu cầu bắt buộc của pháp luật?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Luật không yêu cầu cụ thể việc tiến hành kiểm tra quá trình lắp điện. Tuy nhiên luật yêu cầu phải giữ cho hệ thống phải hoạt động bình thường và an toàn cho người và hệ thống liên tục mọi lúc, mọi nơi. Luật không cho phép việc mất điện khi không có kế hoạch hoặc báo trước, nhưng luật cho phép việc dừng cung cấp điện chỉ khi tiến hành kiểm tra định kỳ và xử lý loại bỏ sự cố tiềm ẩn được phát hiện trong quá trình kiểm tra.</p>\r\n\r\n<p style=\"text-align: justify;\">Nếu tai nạn hay hỏa hoạn xuất hiện ở nơi mà sự cố điện nghi ngờ có thể xảy ra, trong khi chế độ vận hành này của phía bạn chứng minh đã làm tốt nhất, đúng quy trình, quy phạm để tránh xảy ra tai nạn. Kết quả điều tra cùng với dữ liệu được lưu trữ sẽ cung cấp cho bạn những chứng cớ và biện hộ tốt nhất khi xảy ra kiện tụng.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi có thể tự tính toán và đặt giá trị tác động cho hệ thống rơ le bảo vệ được không?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Hệ thống rơ le bảo vệ cho hệ thống điện trong nhà máy phát điện, trong trạm biến áp truyền tải, phân phối có kết cấu kiểu điện cơ, bán dẫn hoặc kỹ thuật số phải làm việc theo giá trị chỉnh định được cài đặt nhằm tách điểm, phần tử bị sự cố ra khỏi lưới nhanh nhất, chọn lọc và tin cậy đảm bảo không ảnh hưởng dẫn đến sự cố lan tràn hoặc sụp đổ hệ thống điện cho các hệ thống phụ tải khác, an toàn cho con người và thiết bị liên quan. Tại Việt Nam, quy định phiếu thông số chỉnh định cần phải được phê duyệt và lưu trữ bởi các cấp có chức năng:</p>\r\n\r\n<p style=\"text-align: justify;\">- Bảo vệ cho các máy biến áp truyền tải, đường dây kết nối hệ thống điện Quốc gia từ 500kV trở lên, bảo vệ cho thanh cái trong trạm biến áp và các tổ máy nhà máy phát điện lớn từ 600MW/tổ phải do Trung tâm điều độ Hệ thống điện Quốc gia (A0) tính toán và cung cấp phiếu chỉnh định.</p>\r\n\r\n<p style=\"text-align: justify;\">- Bảo vệ cho các máy biến áp truyền tải 220,110kV, đường dây truyền tải 220, 110kV, bảo vệ thanh cái trạm biến áp cấp điện áp 110kV trở lên&nbsp; phải do Trung tâm điều độ Hệ thống điện Miền (A1, A2, A3) tính toán và cung cấp phiểu chỉnh định.</p>\r\n\r\n<p style=\"text-align: justify;\">- Bảo vệ cho hệ thống trung áp trở xuống trong phần quản lý của các Công ty Điện lực tỉnh như các máy biến áp 35kV, đường dây 35kV trở xuống phải do Phòng điều độ các Điện lực tính toán hoặc phê duyệt chấp nhận kết quả hoặc các thuyết minh tính toán và cung cấp phiếu chỉnh định.</p>\r\n\r\n<p style=\"text-align: justify;\">Bạn có thể tự tính toán (hoặc thuê đơn vị tính toán chỉnh định) cho các thiết bị thuộc phạm vi tài sản bạn quản lý được tính từ ranh giới kết nối với Hệ thống điện quốc gia. Thông số bảo vệ được tính toán phụ thuộc theo sơ đồ kết nối, công nghệ, phụ tải thực tế của bạn. Thông số tính toán, loại rơ le bảo vệ, kết quả thí nghiệm hệ thống rơ le bảo vệ… được coi là một phần hồ sơ trình cho các công ty Điện lực nghiệm thu trước khi đóng điện cung cấp tới trạm biến áp, nhằm đảm bảo thiết bị của bạn đã đáp ứng các tiêu chuẩn sẵn sàng kết nối đến hệ thống điện chung.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tại sao cần phải kiểm tra dây dẫn</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Dòng điện sẽ tìm đường dễ nhất để đi. Bất kỳ sự cố hay liên kết yếu nào trong mạng điện đều có thể khó bị phát hiện nếu không có kiểm tra đúng quy trình. Trong trường hợp sự cố tiềm ẩn mà lại không được kiểm tra xử lý ngăn chặn, khi xảy ra nó có thể phát triển lan tràn gây ra những hậu quả vô cùng nghiêm trọng như cháy nổ, điện giật thậm chí là chết người. Mạch điện với dòng 13A trở lên mà không được nối đất có thể làm cho tất cả các bộ phận kim loại trở nên có điện từ cảm ứng, nếu một bộ phận của mạch xảy ra sự cố chạm đất sẽ gây ra hư hỏng do mang điện áp tăng cao. Kiểm tra dây dẫn tĩnh có thể xác định được sự cố, vị trí sự cố và đưa ra cách khắc phục.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Quá trình kiểm tra sẽ gây ra gián đoạn cung cấp điện, dừng sản xuất ?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Việc mất điện trong thời gian ngắn có thể chấp nhận được trong mạng cấp điện nhỏ trong toàn hệ thống. Nhưng hầu hết các quá trình kiểm tra được tiến hành trong khi hệ thống vẫn đang hoạt động, các gián đoạn này có thể được lên kế hoạch trước để phù hợp với công việc hàng ngày cũng như được luật cho phép.</p>\r\n\r\n<p style=\"text-align: justify;\"><img alt=\"\" src=\"/uploads/images/gamuda-city.jpg\" /></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Kiểm tra và thí nghiệm điện là yêu cầu của công ty bảo hiểm?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Rộng hơn, công ty bảo hiểm yêu cầu rằng quá trình kiểm tra và thí nghiệm phải được tiến hành đúng với thủ tục, tiêu chuẩn cơ bản. Nếu xảy ra tai nạn mặc dù có thể tránh được, mà luật xác định sai phạm là do bạn đã không tuân thủ các bước kiểm tra trước khi đưa thiết bị vào làm việc hoặc thí nghiệm định kỳ đánh giá theo yêu cầu khi bạn tự thực hiện (có chứng minh được năng lực) hoặc không do một đơn vị có năng lực được cấp phép. Các công ty bảo hiểm sẽ không trả bất cứ khoản phí hay bồi thường nào cho việc vi phạm này gây ra.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Công ty bảo hiểm gần đây đã tiến hành một cuộc kiểm tra mà không yêu cầu chúng tôi phải tiến hành kiểm tra và thí nghiệm điện.</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Người kiểm tra sẽ không nhất thiết phải xác định sự cần thiết của việc duy trì cấp điện an toàn trong quá trình kiểm tra của mình, đặc biệt nếu một vấn đề thảo luận được đưa ra. Vì quá trình kiểm tra không được yêu cầu chi tiết nhưng các yêu cầu về luật liên quan đến vấn đề an toàn vẫn phải được đáp ứng.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Chi phí cho&nbsp; thí nghiệm và kiểm tra quá trình lắp đặt điện</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Mức giá được xác định trên cơ sở đơn giá của hệ thống thiết bị cần thí nghiệm (cấp điện áp, chủng loại thiết bị, hạng mục thí nghiệm…) nhân với số thiết bị có trong hệ thống. Kết hợp với những điều kiện hiện có và có thể ảnh hưởng đến thời gian thi công do khó khăn hoặc sắp xếp từ khách hàng, môi trường thi công…sẽ xác định được toàn bộ chi phí. Hãy liên lạc với ETRC để có thể xác định đầy đủ những việc cần thí nghiệm và kiểm tra, cũng như phương án thi công đảm bảo rút ngắn thời gian không hữu ích.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Nhà máy của chúng tôi hoạt động 24 giờ/1 ngày, các bạn làm thế nào để tiến hành kiểm tra và thí nghiệm nếu chúng tôi không thể ngừng sản xuất ?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) ETRC đầy đủ kinh nghiệm để làm việc trong môi trường sản xuất 3 ca liên tục. Vì phần lớn quá trình kiểm tra tiến hành trong lúc vận hành có điện, vì vậy chúng tôi có kế hoạch kiểm tra và thí nghiệm trong trường hợp như kỳ nghỉ, hỏng hóc, thay đổi công nghệ, vệ sinh, thay ca hay ngày nghỉ cuối tuần.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi thuê cơ sở, nhà xưởng, mặt bằng sản xuất, kiểm tra và thí nghiệm hệ thống điện là trách nhiệm của người chủ hay của tôi?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Bạn có trách nhiệm đảm bảo bạn và nhân viên phải tuân theo luật AN TOÀN &amp; SỨC KHỎE. Tuy nhiên nó thường phụ thuộc vào quy định trong hợp đồng mà bạn hay chủ cho thuê nhà xưởng sẽ trả cho việc tiến hành thí nghiệm. Thông thường nếu bạn có hợp đồng thuê bao trong đó có sửa chữa toàn bộ thì chi phí sẽ phụ thuộc vào bạn.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi nghe nói là tôi chỉ cần thí nghiệm một phần hoặc chỉ một số hạng mục của hệ thống thiết bị điện</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Thực hiện theo quy định của quốc tế như IEEE, IEC và của Việt Nam- EVN, bạn có thể tin cậy vào việc thí nghiệm mẫu, nếu bạn lưu giữ đầy đủ dữ liệu về toàn bộ hệ thống trước đó. Khi tiếp nhận quản lý hệ thống đang vận hành, bạn chỉ phải tiếp tục các hạng mục theo đúng lịch định kỳ và khuyến cáo trong hồ sơ mà không cần phải thí nghiệm lại tất cả các thiết bị từ đầu.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi nghe nói hiệu ứng ảnh soi phát nhiệt là ổn định, đầy đủ và tôi không cần tiến hành kiểm tra toàn bộ việc lắp đặt trước đó hoặc thí nghiệm định kỳ</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Hiệu ứng ảnh soi phát nhiệt định kỳ là một lựa chọn tốt để xác định tỏa nhiệt ở chỗ nối, cầu chì, thanh cái, máy cắt, máy biến áp, tủ hợp bộ … có thể giúp ngăn ngừa hỏng hóc, sự cố do tiếp xúc hoặc phóng điện cục bộ, dòng rò do kém cách điện gây ra, tránh được sự cố cháy nổ, hỏa hoạn trong nhiều trường hợp. Hiệu ứng ảnh nhiệt không phát hiện hoặc để đánh giá đến một số hư hỏng thiết bị, như nối đất kém, cáp bị quá tải, sụt áp… Vì vậy, công tác thí nghiệm và kiểm tra định kỳ toàn bộ nên được tiến hành dù trong bất kỳ chế độ nào.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Một số người khuyên tôi xác định khối lượng phần thí nghiệm trên dựa trên diện tích, công suất, dung lượng. Tại sao bạn lại chọn dựa trên số mạch, số thiết bị ?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Không có sự tương quan thực sự giữa diện tích và số mạch. Nếu bạn đã thuê một công ty thí nghiệm mà trả phí dựa trên diện tích, chúng tôi tin rằng điều này tạo ra áp lực với các kỹ sư thí nghiệm để tiết kiệm chi phí trong việc thí nghiệm tại những nơi mà mật độ thiết bị mạch dày đặc vì tốc độ tiến hành phải nhanh hơn. Điều này cũng không phản ánh chính xác mức độ công việc và chi phí.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi có thể tự tiến hành thí nghiệm trong doanh nghiệp?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Được, bạn cần có thiết bị thí nghiệm được kiểm chuẩn định kỳ, quy trình thí nghiệm hệ thống quản lý chất lượng tiêu chuẩn và đặc biệt những nhân viên có đủ năng lực và kinh nghiệm làm việc.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Điều gì sẽ xảy ra nếu chúng tôi không tiến hành thí nghiệm ?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Cho đến khi xảy ra sự cố, tai nạn, thì dĩ nhiên trước đó có thể không có gì xảy ra. Nhưng việc duy trì an toàn trong cung cấp điện là yêu cầu bắt buộc của pháp luật. Vì vậy những tai nạn mà có thể ngăn chặn được, thì nếu khi xảy ra sự cố có thể bị điều tra, khiển trách, thôi việc hoặc truy tố và không được bảo hiểm.</p>\r\n\r\n<p style=\"text-align: justify;\">Bạn cũng có thể làm giảm thiệt hai bằng cách chứng minh bạn không thể duy trì hệ thống hoạt động thích hợp mà hậu quả có thể gây ra bồi thường thiệt hại.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi điều hành một doanh nghiệp nhỏ, tôi có cần phải thí nghiệm các thiết bị không?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Quy định làm việc của ngành điện bắt buộc với tất cả các doanh nghiệp kể cả công ty đa quốc gia, vì vậy công ty của bạn cũng phải tuân theo.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"color: #ff0000;\">Q) Tôi sợ rằng hệ thống điện của tôi đã tương đối cũ, việc tiến hành thí nghiệm có tốn kém không?</span></strong></p>\r\n\r\n<p style=\"text-align: justify;\">A) Vì khi tiến hành thí nghiệm, chúng tôi xác định chính xác các sự cố tiềm ẩn, chi phí trong các trường hợp đều không quá cao. Sự cố tiềm ẩn thường là liên quan đến lỗi cách điện suy giảm và hệ thống tiếp địa, mặc dù những lỗi này thường nguy hiểm nhưng chi phí khắc phục thường không quá cao.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"color: #ff0000;\">Q) Hệ thống điện của tôi bao lâu lại nên được tiến hành thí nghiệm?</span></strong></p>\r\n\r\n<p style=\"text-align: justify;\">A) Theo IEEE quốc tế cũng như Quy phạm Vận hành HTĐ Việt Nam áp dụng thì khoảng thời gian tiến hành thí nghiệm định kỳ là :</p>\r\n\r\n<p style=\"text-align: justify;\">- Hệ thống điện dân dụng, hạ áp: tối đa 10 năm</p>\r\n\r\n<p style=\"text-align: justify;\">- Hệ thống điện trong các hệ thống toà nhà kinh doanh, thương mại: tối đa 5 năm</p>\r\n\r\n<p style=\"text-align: justify;\">- Hệ thống điện trong nhà máy công nghiệp, hệ thống điện truyền tải và phân phối cao áp: tối đa 3 năm.</p>\r\n\r\n<p style=\"text-align: justify;\">Ngoài ra các thiết bị mới đưa vào vận hành lần đầu sau 1 năm cần được thí nghiệm lại để có các thông số cho công tác bảo hành với nhà chế tạo cung cấp và tham khảo tốc độ suy giảm chất lượng của thiết bị để có các kế hoạch thí nghiệm lần sau trong thời gian dài.</p>\r\n\r\n<p style=\"text-align: justify;\">Xem chi tiết quy định của EVN.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"color: #ff0000;\">Q) Các thiết bị điện của tôi bao lâu lại được thí nghiệm lại?</span></strong></p>\r\n\r\n<p style=\"text-align: justify;\">A) Kết quả của các lần thí nghiệm trước dùng để đánh giá các vấn đề hỏng hóc cũng như tốc độ xuống cấp của thiết bị do già cỗi hoá theo tự nhiên, do môi trường, kỹ năng vận hành. Các thiết bị mới sau khi đưa vào vận hành cần được kiểm tra tổng thể thông số sai lệch sau 1 năm đầu vận hành. Sau đó sẽ theo thời gian định kỳ xác định (như trong mục trên), với các thiết bị hay xảy ra hỏng hóc, quá trình già cỗi nhanh, hoặc nghi ngờ qua các hiện tượng bất thường (tiếng kêu bất thường, làm việc không đúng đặc tính..)</p>\r\n\r\n<p style=\"text-align: justify;\">Nhưng phải lưu ý rằng các nhân tố chủ quan ảnh hưởng khác như khả năng, trình độ của nhân viên trong việc xác định, phán đoán đánh giá các sự cố tiềm ẩn hay hỏng hóc phải xét đến để có những biện pháp phù hợp. Hư hỏng cơ khí cũng cần được lưu ý.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><strong>Q) Tôi có thể thí nghiệm lắp đặt hệ thống điện của mình rẻ hơn ở các nơi khác, tại sao tôi nên chọn ETRC?</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">A) Không phải tất cả các công ty thí nghiệm đều cung cấp các dịch vụ có chất lượng giống nhau. Bạn có thể yên tâm ETRC có hệ thống quản lý chất lượng, đầy đủ kinh nghiệm để cung cấp tỉ mỉ và hiệu quả những thông tin về hệ thống của bạn, cho phép bạn có thể yên tâm hoàn toàn&nbsp; rằng mọi sự cố hỏng hóc hiện tại đều được phát hiện và có báo cáo phân tích rõ ràng. Trong thực tế với báo cáo chi tiết mà ETRC cung cấp, chi phí của bất kỳ công việc khắc phục tương tự cũng thấp hơn mà các bản báo cáo chi tiết khác đưa ra.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"color: #ff0000;\">Q) Làm sao tôi biết khi nào đến lần thí nghiệm tiếp theo hệ thống của tôi?</span></strong></p>\r\n\r\n<p style=\"text-align: justify;\">A) Chúng tôi lưu giữ tất cả các thông tin về khách hàng, cùng với lịch thí nghiệm lại trong cơ sở dữ liệu của chúng tôi và yêu cầu của khách hàng. Chúng tôi sẽ chuyển đến các thông báo để nhắc và tư vấn đến khách hàng chuẩn bị các kế hoạch sản xuất để lần thí nghiệm tiếp theo sẽ được tiến hành.</p>\r\n\r\n<p style=\"text-align: justify;\">………………………….</p>\r\n\r\n<p style=\"text-align: justify;\">Bạn có những thắc mắc xin đừng ngần ngại,</p>\r\n\r\n<p style=\"text-align: justify;\">Hãy gửi ngay những yêu cầu cho chúng tôi để được tư vấn, trả lời.</p>', '', '', '', '', 0, 44, 1, -1, 0, -1, -1, 0, 1, '', '', '', 3, 3, '2017-11-28 10:52:45', '2019-03-04 15:00:15'),
