(97, 'Cụ bà 79 tuổi tàng trữ 2.300 kíp nổ và 153 kg thuốc nổ', 'cu-ba-79-tuoi-tang-tru-2-300-kip-no-va-153-kg-thuoc-no', '', 49, 'vietnamese', '[\"52\",\"46\",\"49\",\"51\",\"48\"]', '/uploads/images/hinh-anh/img01.jpeg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<h2 class=\"article-summary\" style=\"margin: 0px 0px 24px; padding: 0px; box-sizing: border-box; -webkit-tap-highlight-color: transparent; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; font-size: 1.125em; line-height: 1.5; font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; vertical-align: baseline; word-break: break-word; outline: 0px; color: rgb(0, 0, 0);\">Chiều 4-3, Cơ quan an ninh điều tra Công an tỉnh Thanh Hóa cho biết vừa khởi tố vụ án, khởi tố bị can, áp dụng biện pháp cấm đi khỏi nơi cư trú đối với bà Ngô Thị Sự (79 tuổi) về hành vi “mua bán trái phép vật liệu nổ”.</h2>', '', '<p style=\"margin: 0px 0px 24px; padding: 0px; box-sizing: border-box; -webkit-tap-highlight-color: transparent; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.5; font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; vertical-align: baseline; word-break: break-word; outline: 0px; color: rgb(0, 0, 0);\">Theo kết quả điều tra ban đầu của Cơ quan an ninh điều tra Công an tỉnh Thanh Hóa, ngày 13-1, lực lượng Đồn biên phòng TP Sầm Sơn (Bộ chỉ huy Bộ đội biên phòng tỉnh Thanh Hóa) phát hiện, bắt quả tang Phạm Thị Cả (26 tuổi, trú xã Quảng Nham, huyện Quảng Xương, Thanh Hóa) đang mua bán trái phép 4kg thuốc nổ, 9m dây cháy chậm.</p>\r\n\r\n<p style=\"margin: 0px 0px 24px; padding: 0px; box-sizing: border-box; -webkit-tap-highlight-color: transparent; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.5; font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; vertical-align: baseline; word-break: break-word; outline: 0px; color: rgb(0, 0, 0);\">Sau đó, Đồn biên phòng TP Sầm Sơn chuyển hồ sơ vụ án trên cho Phòng an ninh điều tra Công an tỉnh Thanh Hóa tiếp tục điều tra, xác minh, mở rộng vụ án.</p>', '', '', '', '', 0, 67, 1, 1, 0, -1, -1, 0, 1, '', '', '', 3, 3, '2019-03-05 15:56:19', '2019-03-11 11:51:30'),
