(143, 'Mạnh Đỗ', 'manh-do', 'tran-2', 51, 'vietnamese', '[\"46\",\"51\"]', '/uploads/images/bai-viet/img9.jpg', '/uploads/images/dt-2.png', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', 'CHUYỂN VĂN PHÒNG GIÁ RẺ – CHUYỂN VĂN PHÒNG HÀ NỘI CHĂM NHƯ KIẾN – CHẤT LƯỢNG NHƯ VÀNG CAM KẾT ĐỀN BÙ 100% NẾU XẢY RA HỎNG...', '<ul style=\"box-sizing: border-box; margin: 0px; list-style: none; padding-right: 0px; padding-left: 0px; text-align: center; font-family: NunitoSans-Regular; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box; padding-bottom: 2px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">23/03/2019</span>&nbsp;giao hữu quốc tế</li>\r\n	<li style=\"box-sizing: border-box; padding-bottom: 2px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">108.0:/05.078</span>&nbsp;(Châu á)</li>\r\n	<li style=\"box-sizing: border-box; padding-bottom: 2px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">108.0:/05.078</span>&nbsp;(Châu âu)</li>\r\n	<li style=\"box-sizing: border-box; padding-bottom: 2px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">108.0:/05.078</span>&nbsp;(tài xíu )</li>\r\n</ul>\r\n', '<p>Lời bài hát: (Intro: Hôm nay... Dành hết lầm lỗi để chia tay Tình ta từ nay vỡ đôi Một dòng nước mắt lăn chạm qua môi...) Lời 1: Một thế giới hư ảo, nhưng thật ấm áp Em xuất hiện khiến những băng giá đời anh bỗng dần tan đi Cuộc đời anh đặt tên là Muộn Phiền nên làm sao dám mơ mình may mắn được trọn vẹn cùng em Ta phải xa em mặc kệ nước mắt em rơi Vì những nguyên do cả đời không dám đối diện Chỉ còn vài gang tấc nhưng lại xa xôi Tình mình tựa đôi đũa lệch đành buông trôi Cầu mong em sẽ sớm quên được tất cả Tìm thấy một người xứng đáng ở bên... Chorus: Từ nay duyên kiếp bỏ lại phía sau Ngày và bóng tối chẳng còn khác nhau Chẳng có nơi nào yên bình được như em bên anh (Tình yêu một lần lỡ bước là muôn dặm trường đau thương...) Hạt mưa bỗng hoá thành màu nỗi đau Trời như muốn khóc ngày mình mất nhau Có bao nhiêu đôi ngôn tình, cớ sao lìa xa mình ta? (Giang tấu: Là nhân duyên Trời ban cớ sao mình chẳng thể thành đôi...) Lời 2: Tại sao quá ngu ngốc bỏ lại mảnh ghép mà đối với nhau là tất cả còn mình thì vụn vỡ... Thế giới thực tại ồn ào vẫn thấy cô đơn Còn hai ta thì khác, chỉ nhìn thôi tim đã thấu Chorus cuối: Từ nay ranh giới của hai chúng ta là yêu nhưng không thể nào bước qua Ngọn cỏ ven đường thôi mà làm sao với được mây... Từ sau câu giã từ êm ái kia Chẳng cơn bão lớn nào bằng bão lòng.. Gặp trong mơ mà cũng không dám gào lên: \" a n h t h ư ơ n g e m . . . \" #MrSiro #MộtBướcYêuVạnDặmĐau Tác giả phụ đề (Tiếng Anh) Trung cúc iwannachoke Mìn Nguyễn Tác giả phụ đề (Tiếng Trung (Đài Loan)) 龔明正 Danh mục Âm nhạc</p>', '', '', '', '', 0, 7, 1, -1, 0, -1, -1, 0, 0, '', '', '', 3, 3, '2019-04-17 11:19:01', '2019-04-24 09:16:49'),
