(3, 'Xe điện Honda A6 phiên bản 2017', 'xe-dien-honda-a6-phien-ban-2017', '', 71, '[\"71\"]', '/uploads/images/products/xe-dien-product-1.png', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '', 11700000, 10700000, '<p>The following maxim applies to us: We are genuine, innovative, ambitious and sustainable. We want to fascinate people as a company and with our products. Our inner conduct is expressed in the success of our products.</p>\r\n', '<p>Tặng mũ bảo hiểm trị giá 200.000đ<br />\r\nMua trả góp lãi suất 0%</p>\r\n', '<p style=\"box-sizing: border-box; margin: 0px 0px 2px; color: rgb(16, 16, 16); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(241, 241, 241);\"><span class=\"left\" style=\"box-sizing: border-box; font-family: Roboto-Bold;\">Thị trường:</span>&nbsp;<span class=\"right\" style=\"box-sizing: border-box;\">Trung đông</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 2px; color: rgb(16, 16, 16); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(241, 241, 241);\"><span class=\"left\" style=\"box-sizing: border-box; font-family: Roboto-Bold;\">Thu nhập:</span>&nbsp;<span class=\"right\" style=\"box-sizing: border-box;\">30.000.000 - 40.000.000đ/1tháng</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 2px; color: rgb(16, 16, 16); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(241, 241, 241);\"><span class=\"left\" style=\"box-sizing: border-box; font-family: Roboto-Bold;\">Công việc:</span>&nbsp;<span class=\"right\" style=\"box-sizing: border-box;\">Làm nail móng, làm tóc, làm trang điểm</span></p>\r\n', '', '<p>gfgd</p>\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 82, 1, 0, 0, -1, 0, 1, 1, 'vietnamese', '', '', '', 3, 3, '2017-10-12 14:57:56', '2019-03-25 11:52:44'),
(4, 'Xe điện Lyva  Sport 2017', 'xe-dien-lyva-sport-2017', '', 71, '[\"71\"]', '/uploads/images/products/xe-dien-product-5.png', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', 7500000, 6500000, '<p>Tottri là bài thuốc bổ trung ích khí gia giảm của PGS.TS Mai Tất Tố - Trường ĐH Dược Hà Nội. Tottri giúp cầm máu, co búi trĩ nhanh, giảm đau rát, chống viêm nhiễm, ngăn ngừa trĩ tái phát.</p>\r\n', '<div class=\"content detail-content\">\r\n<p>Chanson Water is proud to present our new revolutionary under-counter stainless steel smart digital faucet ionizer.</p>\r\n\r\n<p>With a new sleek Stainless Steel design the Chanson Miracle Max Royale&nbsp;will provide high quality ionized water for your drinking needs.</p>\r\n\r\n<p>In addition with the new touch sensitive smartphone panel you can easily&nbsp;select the water level of your choice.</p>\r\n\r\n<p>Using the Miracle Max Plus as the engine to the Miracle Max Royale&nbsp;(VS-A705) this is a machine that you must have in your kitchen.</p>\r\n\r\n<p>Beautifully designed faucet head will provide a plasant look and feel to the&nbsp;kitchen as well as getting your friends and family curious to this device.</p>\r\n</div>\r\n', '<p>Tặng mũ bảo hiểm trị giá 200.000đ<br />\r\nMua trả góp lãi suất 0%</p>\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 41, 1, 0, 1, -1, 0, 0, 1, 'vietnamese', '', '', '', 3, 3, '2017-10-12 14:58:24', '2019-03-25 11:52:36'),
