e;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Đường kính của vòng:</span>&nbsp;<span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">9 mm</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Tính xả giao: </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Loài thân thiện với các giống khác</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Nhu cầu nước:</span>&nbsp;<span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">hồ bơi nhỏ (2 m² tối thiểu)</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Chăm sóc:</span>&nbsp;<span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">loài dễ dàng</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">loài dễ dàng</span>&nbsp;<span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Ở tuổi trưởng thành và ra lột xác: nam màu nâu nữ</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bộ lông / thay lông: </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Lột xác vào cuối mùa xuân</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\"><span class=\"span_1_wtf\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Kích thước:&nbsp;</span><span style=\"box-sizing: border-box; margin: 0