(13, 'TAM CỐC - NINH BÌNH 42231231', 'tam-coc-ninh-binh-42231231', '', 75, '[\"66\",\"71\",\"75\"]', '/uploads/images/san-pham-detail-005.jpg', '[{\"images\":\"\\/uploads\\/images\\/the-sapphire-condotel-ha-long.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/img-duan(1).jpg\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', 0, 0, '<p><span style=\"color: rgb(56, 56, 56); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 15px;\">Tấm thăm trần K Service được sản xuất bởi Tập đoàn Knauf của Đức trên dây chuyền sản xuất thạch cao tiêu chuẩn thế giới và được phân phối bởi Công ty Cổ phần Zinca Việt Nam – tấm có khung nhôm, đem lại hình thức sạch đẹp , được ứng dụng rộng rãi thỏa mãn các yêu cầu về kết cấu và cơ lý của hệ trần.</span></p>\r\n', '', '', '', '<p style=\"box-sizing: border-box; margin-bottom: 0.53em; margin-top: 0px; color: rgb(56, 56, 56); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Thông tin chungg</span>: Tấm thăm trần Knauf K Service là tấm thăm trần có khung nhôm, đem lại hình thức sạch đẹp , được ứng dụng rộng rãi thỏa mãn các yêu cầu về kết cấu và cơ lý của hệ trần.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-bottom: 0.53em; margin-top: 0px; color: rgb(56, 56, 56); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Thông tin sản phẩm:</span></p>\r\n\r\n<ul style=\"box-sizing: border-box; list-style-position: initial; list-style-image: initial; margin-top: 0px; padding-right: 0px; padding-left: 0px; margin-bottom: 0.53em; color: rgb(56, 56, 56); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Độ dày (mm): 9</li>\r\n	<li style=\"box-sizing: border-box; margin-bott