ng your return. planning your return</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 5px 0px; list-style: disc; font-size: 16px; line-height: 24px; color: rgb(255, 255, 255); font-family: Roboto_Regular;\">Will guarantee to have you planning your return. planning your return</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 5px 0px; list-style: disc; font-size: 16px; line-height: 24px; color: rgb(255, 255, 255); font-family: Roboto_Regular;\">Will guarantee to have you planning your return. planning your return</li>\r\n</ul>\r\n', '<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">Công ty Cổ phần Nam Tiến Lào Cai – Đơn vị chủ đầu tư dự án Scenia Bay Nha Trang có nền tảng phát triển minh bạch, cùng với tiềm lực tài chính vững chắc sẽ tạo đà phát triển cho dự án trong tương lai không xa. Trụ sở chính của công ty tại thành phố Lào Cai, Hà Nội, với tổng tài sản ước tính đạt 1,800 tỷ đồng, doanh thu trung bình hàng năm ở mức 455 tỷ đồng – là những con số biết nói thể hiện rõ khả năng tài chính đảm bảo của Chủ đầu tư khiến mọi Nhà đầu tư đều an tâm.</span><br style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\" />\r\n<span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">17 năm xây dựng và phát triển, CĐT dự án Nha Trang Bay đã hình thành và tích lũy kinh nghiệm vượt bậc trong lĩnh vực xây dựng, tiêu biểu phải kể đến Công trình đường đại lộ Trần Hưng Đạo, công trình K sông hồng, đường L4D, L4E, đầu tư các dự án Tiểu khu đô thị số 1, Tiểu khu đô thị số 3, Tiểu khu đô thị số 5, Khu đô thị mới Lào Cai – Cam Đường … Nhờ kinh nghiệm quý báu nay đã được áp dụng và triển khai tại Scenia Nha Trang Bay – dự án khởi đầu cho kế hoạch “xuống biển” đầu tư của Đại gia vùng Tây Bắc. Scenic Bay Nha Trang được đầu tư tâm huyết và thừa hưởng kinh nghiệm suốt hơn 1 thập kỷ, chắc chắn sẽ là “điểm sáng” đầu tư mới, thu hút sự quan tâm của các Nhà đầu tư tiềm năng.</span></p>\r\n', 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14896.302065253873!2d105.80051389999998!3d21.0296642!3m2!1i1024!2i768!4f13.1!4m3!3e0!4m0!4m0!5e0!3m2!1svi!2s!4v1553069836435&amp;amp;quot; width=&amp;amp;quot;600&amp;amp;quot; height=&amp;amp;quot;450&amp;amp;quot; frameborder=&amp;amp;quot;0&amp;amp;quot; style=&amp;amp;quot;border:0', '<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">Không như những dự án Condotel nằm trên trục đường Trần Phú, Scenia Bay Nha Trang “dẫn lối” Quý khách đến với một tuyến đường Phạm Văn Đồng – vốn được mệnh danh là “hoa hậu” với bãi tắm dài tuyệt đẹp. Lựa chọn vị trí đặt tuy còn mới, nhưng cũng không hề kém cạnh về tiềm năng sinh lời có được từ vị trí, khi Scenia Bay là dự án duy nhất sở hữu 4 mặt tiền hướng ra những tuyến phố chính của trung tâm phố biển gồm: Phạm Ngọc Thạch, Sao Biển, Nguyễn Biểu và Phạm Văn Đồng. Theo kỳ vọng từ các chuyên gia lâu năm trong ngành BĐS nghỉ dưỡng, vị trí dự án Nha Trang Bay sẽ tạo được sức hút đặc biệt với Quý vị khách hàng tiềm năng, đem tới gia tăng giá trị tài sản cho mọi Nhà đầu tư.</span><br style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\" />\r\n<span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">“Chỉ một bước tới biển” và “tiện” di chuyển tới khu vực trung tâm và các địa điểm du lịch nổi tiếng của Nha Trang – cũng là thế mạnh vượt trội của dự án căn hộ Scenia Bay, biến dự án thành “tiêu điểm” lựa chọn của mọi du khách trong và ngoài nước để có được những trải nghiệm nghỉ dưỡng tuyệt vời nơi phố biển. Theo đó, công suất phòng tại dự án (đặc biệt trong mùa cao điểm) được dự đoán không dưới 85%. Và, các Nhà đầu tư nhạy bén với thị trường sẽ là những người “nhẩm tính” dễ dàng nhất nguồn lợi nhuận thu về từ việc cho thuê căn hộ Scenia Bay. Vì thế, đối với một dự án sinh lời hiệu quả như Scenic Bay Nha Trang, không Nhà đầu tư nào muốn “từ bỏ” cơ hội được xuống vốn đầu tư.</span></p>\r\n', '40', '40 km đến Sân bay Cam Ranh', '2', '40 km đến Sân 