 15px; float: left; width: 585px;\">\r\n<div class=\"item\" style=\"box-sizing: border-box; margin-bottom: 20px;\">\r\n<div class=\"icon\" style=\"box-sizing: border-box; width: 111px; display: inline-block; float: left; font-family: Roboto, sans-serif; font-size: 14px;\"><img alt=\"\" src=\"file:///C:/xampp/htdocs/tu.com/templates/frontend/resources/images/i4.png\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; transition: all 0.7s ease 0s; object-fit: cover;\" /></div>\r\n\r\n<div class=\"nav-icon\" style=\"box-sizing: border-box; width: 444px; display: inline-block; float: right; font-family: Roboto, sans-serif; font-size: 14px;\">\r\n<h4 class=\"title\" style=\"box-sizing: border-box; font-family: inherit; line-height: 1.1; color: inherit; margin-top: 10px; margin-bottom: 10px; font-size: 18px;\">TÍNH PHÁP LÝ ĐẢM BẢO – SỔ ĐỎ SỞ HỮU LÂU DÀI</h4>\r\n\r\n<p class=\"desc\" style=\"box-sizing: border-box; margin: 0px; line-height: 28px; height: 248px; overflow: hidden;\">Thị trường đầu tư BĐS nghỉ dưỡng hiện nay chứng kiến tâm lý e ngại rủi ro khi giao dịch của đại đa số các Khách hàng và Nhà đầu tư tiềm năng – khi tính pháp lý của dự án không được bảo đảm. Trong khi vấn đề pháp lý của dự án đang là “điểm nóng”, thu hút sự quan tâm của Giới đầu tư, dự án Scenia Bay Nha Trang “tự tin” lấy pháp lý làm điểm mạnh để hút Khách hàng. Chủ đầu tư uy tín Scenic Bay Nha Trang, tài chính vững mạnh cùng pháp lý sổ đỏ quyền sở hữu lâu dài sẽ giúp các Nhà đầu tư phòng ngừa những rủi ro về mặt pháp lý, tránh ảnh hưởng đến quyền lợi của các Chủ sở hữu căn hộ trong tương lai.</p>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '<p style=\"text-align: justify;\"><img alt=\"\" src=\"/uploads/images/img10.png\" style=\"width: 1140px; height: 429px;\" /></p>\r\n', '<p><img alt=\"\" src=\"/uploads/images/img11.png\" style=\"width: 1161px; height: 691px;\" /></p>\r\n', '<p class=\"desc\" style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Roboto, sans-serif; font-size: 14px; text-align: center;\">Chủ đầu tư Công ty Nam Tiến Lào Cai trong tương lai sẽ kiến tạo nên một tổ hợp nghỉ dưỡng độc đáo, đầy đủ tiện ích, đảm bảo một cuộc sống văn minh, hay một kỳ nghỉ dưỡng trọn vẹn cho mọi Quý khách hàng, gồm các tiện ích ngay trong nội khu như hồ bơi, Gym, khu tập dưỡng sinh (đáp ứng nhu cầu của mọi thế hệ). Trong đó, điểm nhấn về tiện ích của dự án Scenic Bay Nha Trang chính là hệ thống nhà hàng, spa và trung tâm thương mại đẳng cấp hơn 7000m2 với các thương hiệu nổi tiếng trong nước và quốc tế.</p>\r\n\r\n<p><img alt=\"\" src=\"file:///C:/xampp/htdocs/tu.com/templates/frontend/resources/images/img12.jpg\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; transition: all 0.7s ease 0s; object-fit: cover; font-family: Roboto, sans-serif; font-size: 14px; text-align: center;\" /><img alt=\"\" src=\"/uploads/images/img12.jpg\" style=\"width: 1043px; height: 576px;\" /></p>\r\n', 0, 106, 1, -1, -1, -1, 0, -1, 1, 'vietnamese', '', '', '', 3, 3, '2019-03-13 10:18:33', '2019-03-27 13:50:11'),
