;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">LIÊN HỆ</strong></a>&nbsp;bao gồm đầy đủ: Tên, địa chỉ, email, số điện thoại (số có sử dụng các công cụ giao thức nhanh như Zalo, Viber, Whatapp, Beetalk…), một vài ghi chú (nếu có). Chúng tôi sẽ gửi báo giá cho khách hàng (đại lý) vào địa chỉ Zalo, Viber, Whatapp, Beetalk, email hàng ngày hoặc gọi điện trực tiếp theo số:</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; color: rgb(79, 79, 79); font-family: Arial; font-size: 12px; text-align: justify;\">- &nbsp; &nbsp; &nbsp; 0901.777.600 - 0934.550.592 (Mr Khánh) – Trưởng phòng Kinh doanh</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; color: rgb(79, 79, 79); font-family: Arial; font-size: 12px; text-align: justify;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 094.8387.993 (Mrs Lê) – hỗ trợ kinh doanh</p>\r\n', '', '', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Roboto, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Ưu điểm vượt trội:</span></p>\r\n\r\n<ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-family: Roboto, sans-serif; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box;\">Tích hợp bộ vi mạch thông minh tự động báo thay lõi, tự động sục rửa màng RO</li>\r\n	<li style=\"box-sizing: border-box;\">Loại bỏ hoàn toàn Asen, Amip ăn não</li>\r\n	<li style=\"box-sizing: border-box;\">Nước đầu ra đảm bảo chất lượng tiêu chuẩn cao nhất về nước uống tinh khiết</li>\r\n	<li style=\"box-sizing: border-box;\">Chữ dập nổi tiêu chuẩn</li>\r\n	<li style=\"box-sizing: border-box;\">Đặc biệt TEM CHỐNG HÀNG GIẢ.</li>\r\n</ol>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Công nghệ lọc RO</span></div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"box-sizing: border-box;\" />\r\nCông nghệ lọc RO có khả năng loại bỏ 99,9% Amip, Asen, các ion kim loại nặng, virus, vi khuẩn và các tạp chất khác cho nguồn nước hoàn toàn tinh khiết. Máy lọc nước của Karofi sử dụng màng lọc RO Filmtec, nhập khẩu trực tiếp từ tập đoàn DOW-USA được NSF chứng nhận và khuyên dùng.</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hệ thống lọc 9 cấp</span></div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"box-sizing: border-box;\" />\r\nHệ thống lọc 9 cấp với các lõi 5, 6, 7, 8, có chức năng:<br style=\"box-sizing: border-box;\" />\r\n- Lõi số 5 - GAC-T33: Lõi được cấu tạo từ than hoạt tính gáo dừa, có tác dụng làm cho nước có vị ngon hơn, ngọt hơn, phù hợp với nhu cầu sử dụng của mọi người.<br style=\"box-sizing: border-box;\" />\r\n- Lõi số 6 - Lõi Khoáng đá (Mineral): Lõi được cấu tạo từ khoáng đá tự nhiên giúp bổ sung khoáng chất có lợi cho cơ thể.<br style=\"box-sizing: border-box;\" />\r\n- Lõi số 7 - Lõi Hồng ngoại xa (Far Infrared): chứa các hạt bóng gốm có khả năng hấp thụ năng lượng nhiệt bên ngoài để phát ra các tia hồng ngoại xa khiến nước được hoạt hóa và dễ hấp thụ vào máu hơn.<br style=\"box-sizing: border-box;\" />\r\n- Lõi số 8: Lõi Nano Silver có khả năng diệt tới 99,99% vi khuẩn trong nước.&nbsp;<br style=\"box-sizing: border-box;\" />\r\n- Lõi 9: Đèn UV (lõi T33) được lắp đặt ở vị trí cuối cùng trong hệ thống lọc nước Karofi, đèn UV(lõi T33) giúp ngăn chặn 100% nguy cơ tái nhiễm khuẩn (Tái tạo khoáng) của nước trong quá trình lưu thông trong hệ thống lọc.</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"box-sizing: border-box;\" />\r\n- Tự động sục rửa màng RO: Mỗi lần máy bắt đầu thực hiện quá trình lọc, máy lọc nước tiêu chuẩn sRO sẽ tự động sục rửa màng lọc RO trong 15s đầu tiên giúp kéo dài tuổi thọ của màng RO và đảm bảo hiệu suất màng lọc.<br style=\"box-sizing: border-box;\" />\r\n- Bộ điều khiển van áp thấp: người dùng chủ động cho máy hoạt động trong trường hợp nước cấp đầu vào yếu hoặc không ổn định.</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-weight: 700;\">Tiết kiệm chi phí</span></div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"box-sizing: border-box;\" />\r\n- Tiết kiệm chi phí thay thế lõi lọc và linh phụ kiện.<br style=\"box-sizing: border-box;\" />\r\n- Tiết kiệm chi phí sử dụng: 1 lít nước qua máy lọc nước RO gia đình thông minh Karofi giá 193đ trong khi đó bạn phải trả 9000đ/lít nếu dùng nước đóng chai.<br style=\"box-sizing: border-box;\" />\r\n- Tiết kiệm điện năng: van áp cao tự động ngắt điện khi nước đầy tránh lãng phí điện, chỉ tiêu thụ khoảng 3 kw/tháng.</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Roboto, sans-serif; font-size: 14px;\">\r\n<div style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\" />\r\n<span style=\"box-sizing: border-box; font-weight: 700;\">Linh phụ kiện chất lượng cao</span></div>\r\n\r\n<div style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\" />\r\nBình áp nhựa, áp thép siêu bền, vòi Karofi công nghệ Mỹ, tủ IQ sang trọng, van điện từ KSD tự động, bơm hút Karofi êm ái có thể hút sâu tới 2m….</div>\r\n</div>\r\n', 'LH: 0934.550.592 để lấy báo giá bán buôn\r\nLiên hệ mua hàng', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 127, 1, -1, -1, -1, 0, -1, 0, 'vietnamese', '', '', '', 3, 3, '2019-04-19 11:54:46', '2019-04-19 17:10:10'),
