(54, 'E Class', 'e-class', 'e-class', 0, 4, 5, 1, 2, '/uploads/images/products/bua-trua.jpg', '\"\"', '<p>Thi công nội thất trọn gói bao gồm thi công phần thô và thi công hoàn thiện. Trong thi công phần thô có đập phá xây dựng lại công trình, thi công sơn bả thạch cao. Thi công hoàn thiện gồm có các hạng mục thi công trang trí</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 1, 0, 0, 1, 1, 'vietnamese', '', '', '', 3, 3, '2017-10-16 10:31:56', '2017-11-13 09:55:35'),
(55, 'S Class', 's-class', 's-class', 0, 6, 7, 1, 3, '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Trang trí nội thất là quá trình bổ trợ cho khâu thiết kế và thi công nội thất. Với những sản phẩm trang trí sẽ khiến không gian nhà bạn bừng sáng. Trang trí nội thất ăn theo phong cách thiết kế có thể là phong cách hiện đại hoặc tân cổ điển</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 1, 0, 0, 1, 1, 'vietnamese', '', '', '', 3, 3, '2017-10-16 11:16:55', '2017-11-13 09:56:23'),
(56, 'Sản xuất đồ gỗ nội thất', 'san-xuat-do-go-noi-that', 'san-xuat-do-go-noi-that', 0, 8, 9, 1, 0, '', '\"\"', '<p>Morehome có xưởng sản xuất đồ gỗ nội thất cao cấp được làm từ gỗ tự nhiên hoặc gỗ công nghiệp. Với đội ngũ thợ lành nghề mang tới cho khách hàng những sản phẩm đồ gỗ tốt nhất, sang trọng nhất cho không gian nội thất</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 1, 1, 'vietnamese', '', '', '', 3, 3, '2017-10-16 11:17:34', '2017-10-16 11:18:02'),
