(71, '10 DỰ ÁN NỔI BẬT NHẤT THỊ TRƯỜNG', '10-du-an-noi-bat-nhat-thi-truong', '10-du-an-noi-bat-nhat-thi-truong1', 0, 4, 5, 1, 0, '', '\"\"', '<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px; font-style: italic; text-align: center;\">Trong một thị trường không ít những dự án vượt trội cả về vị trí, quy mô, quy hoạch, chính sách thì thử thách tạo ra cho các nhà đầu tư là phải chọn được sản phẩm phù hợp và tốt nhất tại một dự án tiềm năng nhất. Chúng tôi cung cấp cho quý vị thông tin chính xác nhất về những dự án mới nhất và nổi bật nhất đảo ngọc, chúng tôi cũng sẽ đưa ra những so sánh khách quan nhất giữa các dự án để khách hàng có cái nhìn tổng quan hơn về cơ hội của mình, và đặc biệt là không bỏ lỡ sản phẩm ưu việt nhất.</span></p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 0, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 3, 3, '2019-03-08 15:48:09', '2019-03-27 14:11:34'),
