(80, 'Giầy Quỳnh Búp Bê', 'giay-quynh-bup-be', 'giay-quynh-bup-be', 0, 8, 9, 1, 0, '/uploads/images/doi-tac-truong/img4.jpg', '\"\"', '<h1 style=\"box-sizing: border-box; font-size: 24px; margin: 20px 0px 10px; font-family: Roboto, sans-serif; line-height: 1.1;\"><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">Với tinh thần: “người Việt Nam dùng hàng Việt Nam” đã được toàn thể người tiêu dùng hưởng ứng trong thời gian gần đây, và ngày nay điều đó đã trở thành thói quen dủa đại bộ phận người tiêu dùng Việt Nam. Giày việt nam xuất khẩu ( Giay VNXK) đã trở thành sự lựa chọn đầu tiên của khách hàng khi có nhu cầu, chưa bao giờ thị trường giày dép việt lại nhộn nhịp và có sức hút đến như vậy.Nhược điểm của giày Việt Nam xuất khẩu là mẫu mã bị hạn chế nhưng bù lại giày Việt Nam xuất khẩu lại rất bền. Chính vì thế, trong những năm trở lại đây, giày VNXK luôn là sự lựa chọn đầu tiên khi đi mua sắm.</span></h1>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 1, 0, 0, 0, 'vietnamese', '', '', '', 3, 3, '2019-04-17 17:07:42', '2019-04-19 16:30:34'),
